INSERT INTO `avtozakaz_pzmarket` VALUES (927866598,'841','#продаю','️Украшения ручной работы','https://t.me/podrobno_s_PZP/841','️₽ / PZM','️#Вязьма #Россия','@matrosoff33',0,'#личные_вещи','фото','AgACAgIAAxkBAAKWtV5QU3YIhtrcR7M1DlKAXB15jiYGAAJArTEbBXOASgoxyXDkb3L_Q-ZKkS4AAwEAAwIAA3kAA5ttAAIYBA','https://t.me/podrobno_s_PZP/841','перенесён','Продам украшения ручной работы\n\nбижутерия, ожерелье, броши, серьги, браслеты, кулоны и многое другое  за Prizm по курсу на день сделки.\n\nОтправка Почтой России или ТК СДЕК.\nTelegram @matrosoff33\nг.Вязьма','https://i.ibb.co/Y0nPYdy/file-79.jpg',0,'',1582317615);
INSERT INTO `avtozakaz_pzmarket` VALUES (528521692,'750','#продаю','️Чай IASO для похудения','https://t.me/podrobno_s_PZP/750','️₽ / PZM','️#Россия','@lidiadobr',0,'#красота_и_здоровье','фото','AgACAgIAAxkBAAKWwF5QVMR0uz7Cz-P1BgNskDuiYsNOAAJBrTEbBXOASnArMz6aHOrZYPPADgAEAQADAgADeAADdi8DAAEYBA','https://t.me/podrobno_s_PZP/750','перенесён','Чай IASO для похудения. За 5 дней минус 2 кг.\n\nСУПЕР ДЕТОКС чай IASO, который дает ПОТРЯСАЮЩИЕ результаты по очистке организма и снижению веса.\n\n 🌿Из 9 трав и растворимой клетчатки. \n\n👍В 2015 году признан МИРОВЫМ БЕСТСЕЛЛЕРОМ среди продуктов по снижению веса в компаниях прямых продаж.\n \n💧Чай, способствующий СНИЖЕНИЮ веса ( 2 кг в неделю, не меняя образа жизни) \n \n🍵Знаменитый во всем мире натуральный напиток для очистки организма. \n\n♻️Преимуществами его уникальной формулы детоксикации организма являются снижение веса и его контроль, повышение энергичности, ясность мышления, улучшение состояния кожи и мягкая очистка кишечника и внутренних органов. \n \n🥃Выпивайте 2,5 стакана в день, чтобы снизить вес до 2 кг за 5 дней. \n \n🌱🌿☘️Оригинальный чай Iaso® Tea содержит уникальное сочетание девяти лекарственных трав, которые очищают тонкий и толстый кишечник, избавляя организм от опасных токсинов.\n\nЦена 60$  курс на месяц/PZM по курсу на день покупки.\n@lidiadobr\nРоссия','https://i.ibb.co/Z1Gj1vX/file-80.jpg',0,'',1579152606);
