INSERT INTO `avtozakaz_pzmarket` VALUES (528521692,'913','#продаю ','️Аппарат Biophonic ','https://t.me/podrobno_s_PZP/913','️₽ / PZM','️#Россия ','@lidiadobr',0,'#красота_и_здоровье ','фото','AgACAgIAAxkBAAKW9l5QV3KzzG8hS4GrNdCtnVRFygkGAAJErTEbBXOASu6wAVoAAVryE234wA4ABAEAAwIAA3gAAwg2AwABGAQ','https://t.me/podrobno_s_PZP/913','перенесён','Омоложение лица в домашних условиях \n\n➡️Использование аппарата Biophonic - это:\n⠀\n👍лучшая альтернатива хирургическому методу подтяжки лица и другим профессиональным процедурам;\n⠀\n👍безболезненный, безопасный и приятный уход за кожей;\n⠀\n👍результаты, сохраняющие длительный эффект.\n⠀\n▶️ПРИНЦИП ДЕЙСТВИЯ АППАРАТА:\n⠀\n🔊 ультразвуковое воздействие; 🌞 фотохромотерапия;\n⚡️ микротоковое воздействие;\n🌊микроволновой расслабляющий массаж.\n⠀\n🔦ПРИМЕНЕНИЕ АППАРАТА СПОСОБСТВУЕТ:\n〰️увлажнению кожи;\n〰️уменьшению мимических и глубоких морщин;\n〰️лифтингу;\n〰️профилактике пигментации;\n〰️осветлению и выравниванию цвета лица;\n〰️снятию отечности;\n〰️профилактике акне (угревой сыпи) и постакне (последствий угревой сыпи).\n⠀\n📝ПОКАЗАНИЯ:\n⠀\n✅возрастные изменения кожи лица и шеи (динамические и статические морщины);\n✅пигментация, шелушение;\n✅ухудшение общего состояния кожи;\n✅поддержание необходимого состояния кожи. \n \nАналогов в России нет ❗️\n\nАкция до 20 января : купи 1 биофоник + 1 получи в подарок 💝 \n\n▪️Цена:12929₽/ PZM по курсу на день заказа \n▪️Россия \n▪️@lidiadobr','https://i.ibb.co/j8Px6WP/file-82.jpg',0,'',1579252226);
INSERT INTO `avtozakaz_pzmarket` VALUES (528521692,'918','#продаю','️Масло растительное холодного отжима 100%','https://t.me/podrobno_s_PZP/918','️₽ / PZM','️#Россия','@lidiadobr',0,'#красота_и_здоровье','фото','AgACAgIAAxkBAAKXCF5QV-TAomPmA2jgl__5SbOj8AYZAAKFrDEbns-ISsy4xm2bi7ez7V9cDwAEAQADAgADeQADcM4FAAEYBA','https://t.me/podrobno_s_PZP/918','перенесён','Продаю МАСЛО ЧЕРНОГО ТМИНА!!!\n\n⠀Масло растительное холодного отжима 100%\nФорма выпуска: бутылка 100 мл\n\nСОСТАВ:\n50% в масле приходится на полиненасыщенные жирные кислоты (60% из них принадлежат к разряду незаменимых:- это альфа-линоленовая кислота до 1%, линолевая кислота — 55–60%, олеиновая кислота – 15–18%, пальмитиновая кислота –10–12%, стеариновая кислота – 1–3%, эйкозеновая кислота — 4–5% и др.\n\nПоказания : \n🔴Бронхиальная астма. Органические летучие вещества способствуют очищению бронхов.\n🔴Аллергия. Тимохинон тормозит высвобождение гистамина из тучных клеток, предотвращая аллергические отёки и сыпь.\n🔴Ревматизм. Фитостеролы снимают аллергические и инфекционные воспаления, вызывающие поражения суставов и сердца.\n🔴Проблемы желудочно-кишечного тракта. Усиливая выработку ферментов, масло чёрного тмина улучшает пищеварение, предотвращает развитие язв.\n🔴Болезнь Альцгеймера и Паркинсона. Защищая нейроны от повреждения, тимохинон предупреждает развитие неврологических поражений.\n🔴Кожные заболевания. Масло чёрного тмина эффективно излечивает экземы, фурункулы, угревую сыпь.\n🔴Рак. Тимохинон уменьшает количество злокачественных клеток на 52%, приостанавливает рост метастаз.\n🔴Мужское бесплодие. Приём масла увеличивает количество и активность сперматозоидов.\n🔴Эпилепсия. Тимохинон обладает противосудорожными свойствами, поэтому снижает интенсивность и частоту эпилептических приступов.\n.\nПри внутренних заболеваниях тминное масло следует пить по 1-2 ч. ложки дважды в день. Чтобы облегчить восприятие продукта, его запивают водой, чаем или заедают 1 ч. ложкой мёда. Курс лечения составляет от 30 до 40 дней.\n⠀\nПри воспалении среднего уха или гайморите в слуховой проход (ноздри) помещают на 20 мин. ватный тампон, смоченный маслом. Для снятия ревматических болей средство втирают в больной сустав дважды в день. При простуде полезно делать горячие ингаляции — вдыхать пар от горячей воды, в которую добавлено 3-4 капли масла.\n⠀\nРекомендуется  также использовать продукт для профилактики, как средство очищения и омоложения организма.\n\n\n▪️Цена: 860₽ \n▪️₽ / pzm \n▪️Россия \n▪️заказ по тел 89841451582 вацап/ Вайбер/ телеграмм @lidiadobr','https://i.ibb.co/7kZddQv/file-83.jpg',0,'',1579350627);
INSERT INTO `avtozakaz_pzmarket` VALUES (528521692,'935','#продаю','️MINERAL DIET для коктелей','https://t.me/podrobno_s_PZP/935','️₽ / PZM','️#Россия','@lidiadobr',0,'#красота_и_здоровье','фото','AgACAgIAAxkBAAKXMV5QWG4ucPUT-jm57QLq8h6kNC1fAAKGrDEbns-ISvK-wTypMCf_CPjADgAEAQADAgADeQADBzQDAAEYBA','https://t.me/podrobno_s_PZP/935','перенесён','MINERAL DIET \nСмесь сухая для приготовления коктейлей\nФорма выпуска: дой-пак - 572 гр\nРег. № декларации соответствия: \nTC N RU Д-RU.АУ40.В.14081 от 07.10.2015\n\nОПИСАНИЕ\nСледуя цели дифференцировать подход к потребностям организма отдельных людей, мы создали специальный шейк, обогащенный более чем 70-ю микро и макроэлементами. Отсюда название – MINERAL DIET.\n\n✔️Нет времени готовить и тщательно пережевывать пищу, ешьте MINERAL DIET. Это всего 2-3 минуты.\n✔️Не уверены в качестве фруктов и овощей (без ГМО, консервантов, пестицидов), ешьте MINERAL DIET.\n✔️После изнурительной тренировки для полноценного восстановления сил, ешьте MINERAL DIET\n✔️При проблемах с балансом кишечной микрофлоры и стулом, ешьте MINERAL DIET\n✔️Для поддержания красоты и здоровья волос, зубов и ногтей, ешьте MINERAL DIET\n✔️Для похудения и сохранения жизненной энергии и сил, ешьте MINERAL DIET\n✔️Для набора массы тела в дополнении к обычному рациону, ешьте MINERAL DIET\n\nЛюди, наиболее нуждающиеся в кальции и других минералах для построения скелета, профилактике остеопороза, это прежде всего – подростки, беременные и кормящие женщины, женщины 40 лет и старше, времени климактерической перестройки организма, старики. MINERAL DIET содержит уникальные и самые высокоусваиваемые формы кальция – Аквамин F и молочный кальций – трикальцияфосфат или ТРИКАФОС.\n\n Вкусы : шоколад , малина , сливки - ваниль , смородина , абрикос \n\nЦена:2200₽ \n₽ / pzm \n@lidiadobr\nТел 89841451582 вацап , Вайбер , телеграмм','https://i.ibb.co/44nrSYd/file-84.jpg',0,'',1579584641);
INSERT INTO `avtozakaz_pzmarket` VALUES (562339355,'936','#продаю','️Персональные генетические тесты IGen BODY и IGen HEALTH ','https://www.youtube.com/watch?v=sqMzsUqEg9Y&feature=youtu.be','️₽ / PZM','️#Иркутск #Россия','@marisorokovikova',0,'#услуги','фото','AgACAgIAAxkBAAKXUl5QWQxvsvCOkaS4MyqGpX88_Dq8AAJFrTEbBXOASko6RFJQO80YqLbCDwAEAQADAgADeQAD6eYDAAEYBA','https://t.me/podrobno_s_PZP/936','перенесён','Персональные генетические тесты IGen BODY и IGen HEALTH. \n\n  Хочу рассказать об  очень важной и нужной каждому человеку услуге - Генетическое тестирование!\n  Речь только о Вашем здоровье.Задавали ли Вы себе  вопросы:\n❓Какие физические нагрузки будут эффективны именно для моего организма?\n❓Какая диета/питание подходит именно мне?\n❓Есть ли у меня предрасположенность к плохому холестерину?\n❓Кто страдает от лишнего веса или желает поправиться - знаю ли от углеводов или Жиров я набираю вес?\n❓Насколько эффективно функционирует сердечно-сосудистая система? \n❓Мой опорно-двигательный аппарат. Что я могу сделать уже сегодня, чтобы сократить риски связанных с ним заболеваний?\n❓Можно ли мне кофе и в какой дозировке?\nРекомендации теста на 46 листах только о Вас: помогут Вам замедлить процесс старения и дольше оставаться молодым!\nIGen -это генетический Паспорт Вашего физического здоровья.\n\nhttps://www.youtube.com/watch?v=sqMzsUqEg9Y&feature=youtu.be\n\n🔬Тест iGen Health - это подробный анализ важных процессов, происходящих в организме и влияющих на здоровье.\n iGen Health расскажет, как ваши гены влияют на процессы пищеварения, укажет на наличие скрытых непереносимостей определенных продуктов. Вы узнаете, как функционирует ваша сердечно-сосудистая система и с какими изменениями здоровья вам, возможно, придется столкнуться. \n  Тест раскажет о вашей предрасположенности к патологическим состояниям опорно-двигательного аппарата.\n\n🔬iGen body - это подробный анализ процессов метаболизма, которые у всех индивидуальны. \n  Так, например, быстрое накопление подкожного жира у одного человека может происходить от излишка жирной пищи, у другого - от углеводной, а третий получил оба признака, да еще и организм его плохо реагирует на физическую нагрузку. \n  iGen body расскажет вам об особенностях вашего обмена веществ: метаболизме белков, жиров и углеводов, процессах сохранения молодости, предрасположенности к повышенному холестерину, и о том, какой рацион, физические нагрузки являются для вас оптимальными, заложенными самой природой. \nТест делается один раз и на всю жизнь. Начиная детям с рождения и до людей преклонного возраста. \nЦена одного теста 7700 руб+комплект для сбора генетического материала 110 руб. Можно за РZM по курсу на момент сделки. Для тех, кто будет покупать за рубли, Дополнительно могу рассказать как можно вернуть обратно 1085 руб себе в кошелёк с покупки. Тесты доступны по всей стране. Сам анализ делается в лабаработии г. Новосибирск, куда вы будете посылать свой биологический материал. Подробности у меня.\n@marisorokovikova\nИркутск. Доставка до любого нас пункта страны Бесплатно.','https://i.ibb.co/rdryh7W/file-85.jpg',0,'',1579636244);
