INSERT INTO `avtozakaz_pzmarket` VALUES (724251015,'273','#продаю ','️Роскошный дом ','https://t.me/podrobno_s_PZP/273','️₽ / PZM','️️#Московская_область #деревня_Пешково','@dobroil',0,'#недвижимость ','фото','AgACAgIAAxkBAAKXy15QW6gZl5zY913Wd6xgd1rk8XTsAAJKrTEbBXOASgt7cwbGqyE-aeZKkS4AAwEAAwIAA3gAAyNtAAIYBA','https://t.me/podrobno_s_PZP/273','перенесён','#продам\nКоттедж 200 м² на участке 8.5 сот\n🔥🔥🔥Новогодняя акция. Цена снижена на 1млн руб‼️‼️‼️до февраля❗️теперь он стоит 6 500 000 рублей!!! 🥳 PRIZM по курсу на день покупки! 🥳 \nРоскошный дом, в Пешково, ул. Сосновая. Строился для себя. Цена из расчета того, что дом не из картона и палок. Сооружение фундаментальное, одна земля стоит 2.5 млн. Сохранившихся чеков на 7.3 млн затрат. Продажа срочная.\nПо краю участка красивые сосны и березы. В доме отопление, свет, канализация (септик), скважина на 38 м. Газ по границе.\nДом построен по проекту с архитектурным надзором, фундамент плита в соответствии с геодезическим планом, блоки толщиной 400 D500,перекрытие межэтажное - монолитное ж/б, перегородки: толщиной 150 мм. и 250 мм. из газобетонных блоков, крыша вальмовая, покрытие металлочерепица, теплица. Все отлично, фундаментально, проект рассчитан на комфортное проживание семьи из 4-6 человек, 2 ванные комнаты, 5 жилых комнат+ кухня-гостиная 30 кв.м. Тихое место, в 3 км от города. Солидные соседи. На участке грибница с опятами, сортовая малина, черешня, груша, яблоня, смородина, крыжовник.\nДом обжитой.\nТребуется доделать полы, штукатурка и он готов к отделке под ваш вкус.\nТак же это отличное вложение денег на будущее. При минимальных вложениях, можно продать будет как минимум в половину дороже! 🥳 \nhttps://www.cian.ru/sale/suburban/219404154\n@dobroiL','https://i.ibb.co/4Vy6W2s/file-91.jpg',0,'',1579875191);
INSERT INTO `avtozakaz_pzmarket` VALUES (528521692,'922','#продаю','️Компенсаторная противоизносная добавка','https://t.me/podrobno_s_PZP/922','️₽ / PZM','️️#Россия','@lidiadobr',0,'#транспорт','фото','AgACAgIAAxkBAAKX2V5QW9206sWzrFHc8N4hzMBd4n-LAAJLrTEbBXOASh4l_TeckRbkXwxxkS4AAwEAAwIAA3gAA8spAAIYBA','https://t.me/podrobno_s_PZP/922','перенесён','SENRECO\nКомпенсаторная противоизносная добавка\nФорма выпуска: флакон, 70 мл.\nОПИСАНИЕ\nДобавка в двигатель нового поколения - уникальный многофункциональный продукт:\n • восстанавливает поверхности в зазорах трущихся деталей Наращивает изношенные поверхности;\n • оптимизирует зазоры в соединениях;\n • существенно экономит топливо;\n • повышает стойкость материалов к износу и коррозии;\n • увеличивает время службы;\n • уменьшает затраты на ремонт;\n • не создает вредных выбросов.\nДополнительным или сопутствующим эффектом являются:\n • повышение давления в цилиндрах ДВС;\n • повышение давления масла;\n • снижение потребления топлива и масла;\n • снижение токсичности выхлопных газов.\n\nНАЗНАЧЕНИЕ:\nЗащита и компенсация износа двигателей внутреннего сгорания легковых и грузовых автомобилей. Полная компенсация износа возможна в ДВС с 40% износом. Защита от дальнейшего износа происходит всегда и на любом пробеге.\nСОСТАВ:\n • индустриальное масло И–40А;\n • комплекс минеральных добавок.\nСПОСОБ ПРИМЕНЕНИЯ:\n 1 Прогреть двигатель до рабочей температуры.\n 2 Встряхнуть флакон с добавкой.\n 3 Вылить содержимое в заливную горловину.\n 4 Запустить двигатель и дать ему поработать 30 минут в режиме холостого хода.\nЭффект наступает в течение пробега около 300 км. Масло и масляный фильтр можно менять как обычно, по сроку ТО.\nОбъем 70 мл. Данный объем добавки используется в ДВС с объемом масла в картере от 3 до 6 литров.\nВНИМАНИЕ! НЕЛЬЗЯ ДОБАВЛЯТЬ В ТОПЛИВО, ТОЛЬКО В МАСЛО ДВИГАТЕЛЯ!\nЦена : 1420 ₽ \n₽/pzm \n@lidiadobr\nТел 89841451582 (вацап, Вайбер, телеграмм )','https://i.ibb.co/JywHm2L/file-92.jpg',0,'',1579875212);
