INSERT INTO `avtozakaz_pzmarket` VALUES (855955957,'1075','#продам','Нарды из янтаря!','https://t.me/podrobno_s_PZP/1075','₽ / PZM','#Россия','@Russlan771018',0,'#хобби_и_отдых','фото','AgACAgIAAxkBAAKKDV5H4nqTt8JEFNlm1JAFH4FL9rTvAAJ6rDEbEQVASl9fXokSjjyZe03LDgAEAQADAgADeAADVEwCAAEYBA','https://t.me/podrobno_s_PZP/1075','одобрен','Продам, нарды из янтаря!\nАвторские нарды «Сокол» - это оригинальный универсальный подарок, который будет оценен по достоинству каждым любителем редких эксклюзивных вещиц. Такие нарды можно купить для руководителя, бизнес партнера, политика или просто состоятельной персоны.\nУникальный рисунок, изображающий сокола, притаившегося на ветки дерева, создавался вручную. Для этого был использован натуральный янтарь различных оттенков.\n\nИгровая доска комплектуется 30 фишками, изготовленными из цельного янтарного композита молочного и темно-каштанового оттенков. Имеется также сертификат качества и солидный транспортировочный кейс с мягкой обивкой.\nцена 150000р.в призм по курсу.торг уместен!\n@Russlan771018\nhttps://vk.com/dzhankyozov1977\nСтавропольский край','https://i.ibb.co/b1cpScs/file-18.jpg',0,'https://t.me/check_user_infobot?start=855955957',1597420128);
INSERT INTO `avtozakaz_pzmarket` VALUES (313854106,'1077','#продам','Иван чай','https://t.me/podrobno_s_PZP/1077','₽ / PZM','#весь_мир','@Ramjus',0,'#красота_и_здоровье','фото','AgACAgIAAxkBAAKKRl5H6-NeEzXnBBIX98Osyao1B4CeAAI9rTEbdeNBStMlMWGIYVDBL0fLDgAEAQADAgADeQAD3UoCAAEYBA','https://t.me/podrobno_s_PZP/1077','одобрен','▪️#Иван_чай ферментированный (зелёный)\n\n▪️Иван-Чай (кипрей, копорский чай) – напиток, приятный на вкус, имеющий мощный оздоровительный эффект! Появился он на Руси и использовался как лекарство от разных недугов. Его второе название – «мужская» трава: положительно влияет на потенцию, нормализует эрективную функцию.  \n#Иван_Чай : содержит витамины группы В,С и железо нормализует обмен веществ является отличным антисептиком очищает организм от шлаков и токсинов увеличивает уровень гемоглобина оказывает мягкое мочегонное действие является эффективным снотворным, седативным нормализует психо-эмоциональное состояние, ночной отдых улучшает и восстанавливает деятельность пищеварительной системы: устраняет запоры, изжогу, дисбактериоз обладает желчегонным, обволакивающем, противовоспалительным, репарационным (ранозаживляющим) и болеутоляющим действием ускоряет грануляцию и эпителизацию повреждений на коже обладает лактационными качествами, что продлевает грудное вскармливание, тем самым улучшая здоровье ребёнка способствует слаженной и эффективной работе эндокринных органов является послеопухолевым средством замедляет старение кожи. \nВыпивая этот напиток после захода солнца, вы повышаете свой иммунитет, даёте шанс организму на успокоение сердечного ритма, снижение артериального давления. Иван-Чай приводит организм в тонус, прибавляет жизненной силы. Он, в отличие от черного чая и кофе, НЕ содержит  такие негативные элементы,  как кислота щавелевая, пуриновые основания и кофеин. \n\nПриготовлен по традиционному копорскому рецепту (без использования метала, нарезки листа и обжарки). \nСвежие листья чая собираются на Урале и подвергаются \"завяливанию\" - процесс длиться от 22 до 32 часов. Далее скручивание. Это процедура разрушения клетчатки листа. Используется полуавтоматическое (на специально сконструированных деревянных устройствах. После скручивания лист проходит ферментацию (находиться в состоянии покоя в специальном помещении без воздействия света), после чего просушивается. Сушка длится несколько дней в специальных помещениях с циркуляцией воздуха при температуре 57 градусов. Следующий этап - дозревание- чай после сушки помещается в тканевые мешочки из натурального льна, где хранится до передачи к покупателю.\n \n▪️ РУБ/PRZ\nЦена 250 рублей за 100 гр по курсу PRIZM\nУпаковка от 400 гр.\nДоставка','https://i.ibb.co/5vH7qGK/file-19.jpg',0,'https://t.me/check_user_infobot?start=313854106',1600173555);
