INSERT INTO `avtozakaz_pzmarket` VALUES (622756469,'1084','#продам','Хемохим','https://t.me/podrobno_s_PZP/1084','₽ / PZM','#Россия','@r_fa_tti',0,'#красота_и_здоровье','фото','AgACAgIAAxkBAAKLO15IONz0Ncj_SXkipVLXv2WtHu7fAALqrTEbtBfwSVAEfg1RhcoQ6xjBDgAEAQADAgADeQADoJ0CAAEYBA','https://t.me/podrobno_s_PZP/1084','одобрен','💪ПРИРОДНЫЙ УСИЛИТЕЛЬ ИММУНИТЕТА💪\n\n💎ПРОДУКТ ГОДА 2019💎\n\n 👑ХЕМОХИМ👑\n\nПоддерживает и укрепляет здоровье всего организма в целом: \n \n💗Нервная система:\n☘️ улучшение сна\n☘️ устойчивость к стрессам\n☘️ уходят панические атаки\n☘️ улучшается память\n☘️ уменьшаются невралгические боли\n☘️ быстрее идет восстановление мозговых функций после инсульта\n.\n💚 Имунная система:\n🌿 укрепление имунитета в весенне-осенние периоды не болеют ОРЗ.\n🌿 эффективен при вирусных инфекциях, таких как цитомегаловирус, герпес зостер, папиллома вирус !!!✌️\n🌿быстро купируются сезонные поллинозы\n.\n❤️ Кровеносная система:\n🌹после 4х месяцев приема Хемохим очищается кровь улучшаются анализы\n🌹эффективен при малокровии, анемии\n🌹улучшается вязкость крови.\n.\n💛 Система пищеварения:\n🌱 нормализуется стул\n🌱 улучшается работа печени, желчного пузыря.\n🌱 после 4х месячного курса Хемохим снимают диагноз \"гепатоз\"\n.\n💙 Гормональная система:\n💧приходит в норму сахар в крови\n💧 улучшается работа женской гормональной системы и как следствие миомы, эндометриозы и кисты либо уменьшаются, либо исчезают вообще.\n.\n💖 Нормализуется артериальное давление\n.\n🧡 Кожа:\n🌈 улучшается состояние кожи, становится упругой и гладкой, проходит сухость на локтях ( из-за улучшения работы надпочечников)\n🌈 эффективен при псориазе\n🌈 папилломки на коже отпадают .\n🖤 Костно-суставная система:\n🌾 уменьшаются боли в суставах.\n🌾 многолетние боли после переломов проходят.\n\n. \n💤 Хемохим и химиотерапия:\n🌼 на фоне приема Хемохим можно постепенно снизить дозу препаратов \n🌼 Пить надо в разное время, за 2 часа до сеанса химии Хемохим будет защищать жизненноважные органы от побочного эффекта химиотерапии\n.\n💛 Лишний вес:\nХемохим усиливает все дренажные системы организма, идет мощная очистка, нормализация функции печени, гормональных и обменных процессов, поэтому лишние килограммы тают..😉💃\n .\n💖 Омоложение:\nПри приеме Хемохим\nочищается кровь, лимфа, гармонизируется энергия во всех органах, идет омоложение нервной, имунной и гормональной систем, поэтому все люди, особенно пожилые чувствуют прилив сил.\n\n.\n💲Стоимость продукта 7000 рублей по курсу Призм на день покупки+доставка💲\n.\n📬Хотите приобрести это чудо средство, тогда пишите мне в личку. Доставка по всей России и в страны СНГ.📬\n\n📲Контакт для связи @r\\_fa\\_tti📲','https://i.ibb.co/26c4F5t/file-26.jpg',0,'https://t.me/check_user_infobot?start=622756469',1581791522);
INSERT INTO `avtozakaz_pzmarket` VALUES (504204681,'1082','#продам','Сыворотка от выпадения','https://t.me/podrobno_s_PZP/1082','₽ / PZM','#россия #весь_мир','@nasiksauz',0,'#красота_и_здоровье','фото','AgACAgIAAxkBAAKLAl5IJE5uY0CCBeXAi1SYAAH1JDzsbAACRq4xG5xbQEp7VWdOYcKX99sBUZEuAAMBAAMCAAN4AAMsMQACGAQ','https://t.me/podrobno_s_PZP/1082','одобрен','#продам \n1. Сыворотка Active против выпадения  \nСыворотка эффективно решает проблему выпадения волос благодаря комплексному воздействию на кожу головы. Эффективность средства клинически доказана. Сыворотка предотвращает преждевременное выпадение и стимулирует рост волос, улучшает кровоснабжение кожи головы, укрепляет корни, пробуждает спящие волосяные фолликулы, способствует росту здоровой волосяной луковицы, увлажняет и питает кожу головы. А так же решает проблему выпадения волос, возникшую вследствие неправильного ухода за волосами, стресса, нарушений кровообращения, а также при других проблемах (сезонное выпадение, авитаминоз, проблемы со здоровьем). Активные компоненты останавливают выпадение и стимулируют рост волос. Эффективность средства клинически доказана: в 100\\% случаев волосы более густые, здоровые и блестящие. Эффект сохраняется до полугода.','https://i.ibb.co/LSqD396/file-24.jpg',0,'https://t.me/check_user_infobot?start=504204681',1581786255);
INSERT INTO `avtozakaz_pzmarket` VALUES (502118086,'1083','#продам','топор Русич','https://t.me/podrobno_s_PZP/1083','₽ / PZM','#Россия #Украина #Весь_мир','@krestyanin_rusi',0,'#для_дома_и_дачи','фото','AgACAgIAAxkBAAKLH15IKZ8JJY89VgNXwWf5QS3-cNh0AAICrjEbf1ZBSqB6-vIcvgJpmSDBDgAEAQADAgADeQADkPACAAEYBA','https://t.me/podrobno_s_PZP/1083','одобрен','Топор в наличии из рессорно-пружинной стали 60Г, насажен на буковое топорище, расклинен деревянным клином, клин и топор посажены на клей — это позволит ему оставаться в рабочем состоянии круглый год при перепадах температуры и влажности. Топор обработан оружейной консервационной смазкой — это защищает его от ржавчины. Топорище частично обоженно, брашированно и пропитано тунговым маслом. В уязвимом месте топорище защищено шорно-седельной кожей. На топоре вытравлены рисунки оберегов Звезда Руси и Коловрат. Для защиты лезвия сделан чехол из шорно-седельной кожи. Топор отлично подойдет для походов, охоты, рыбалки.\n\n○ общая длина 47 см\n○ длина лезвия 12.5 см\n○ вес 1.2 кг\n○ сталь 60Г\n○ консервационная смазка\n○ топорище из бука\n○ пропитка тунговым маслом\n○ защита на топорище\n○ рисунок на топоре\n○ чехол из кожи\n\nЦена: 6000руб / призм по курсу (при оплате в призм скидка 10\\%)\n\nЕще более 80 работ у нас на сайте в наличии и под заказ: ttopor.com','https://i.ibb.co/26B4QGX/file-25.jpg',0,'https://t.me/check_user_infobot?start=502118086',1581787829);
