INSERT INTO `avtozakaz_pzmarket` VALUES (491301322,'1124','#продам','GPS терминал УМКа310','https://t.me/podrobno_s_PZP/1124','PZM','#Россия','@IronRoger',0,'#личные_вещи','фото','AgACAgIAAxkBAAKVDF5PsIf9wgVmiWx-UMezpancQR5RAAKOrDEbpyGBSvGEx3pAIxJ321uDkS4AAwEAAwIAA3gAA4MlAAIYBA','https://t.me/podrobno_s_PZP/1124','одобрен','Терминалы УМКа310 – компактные бюджетные устройства, оптимальные для решения базовых задач спутникового мониторинга.\n\nУстройства могут передавать координаты и другие навигационные данные в облачную платформу ГЛОНАССсофт или любой другой хостинг, имеющий открытый протокол, в том числе протокол EGTS, используемые в системе «ЭРА-ГЛОНАСС». Как и УМКа301, УМКа310 способны одновременно передавать данные на 3 сервера.\n\nБлагодаря пакетному способу передачи данных на базе открытого бинарного протокола Wialon Combine, УМКа310 имеет низкий расход трафика на фоне высокой частоты и большого объема передаваемых данных.\n\nНастройка и управление терминалом происходит через SMS, GPRS или Bluetooth 4.0.\n\nПомимо функции мониторинга местоположения, скорости и направления движения ТС, в УМКа310 также реализована возможность получения данных о расходе топлива (опционально доступна поддержка интерфейса RS-485 для подключения 1-3 ДУТ).','https://i.ibb.co/TMgccpg/file-71.jpg',0,'https://t.me/check_user_infobot?start=491301322',1582280931);
INSERT INTO `avtozakaz_pzmarket` VALUES (704498174,'1125','#продам','АПИРЕФЛЕКСОТЕРАПИЯ + МАССАЖ','https://t.me/podrobno_s_PZP/1125','₽ / PZM','#Краснодар','@Lusy_Kazanova',0,'#красота_и_здоровье','фото','AgACAgIAAxkBAAKVc15P8bh-ImK7Pr8Cff_zaEB7qhPZAALdrDEbgZiBSphQUQLjxdJSxAXBDgAEAQADAgADeQAD3S0DAAEYBA','https://t.me/podrobno_s_PZP/1125','одобрен','◼уникальная авторская методика оздоровления\n\"Апирефлексотерапия + массаж\"\n\n◼25 февраля - 5 марта 2020г.\n8:00-22:00 в Краснодаре\n\n◼ПОКАЗАНИЯ:\n✔остеохондроз\n✔артрит\n✔артроз\n✔боли в спине\n✔частые вирусные заболевания вследствие сниженного иммунитета\n✔ДЦП\n\n◼ПРОТИВОПОКАЗАНИЯ:\n🚫онкология\n🚫аллергия на пчелиный яд\n\n◼Курс проводят авторы методики:\n\n👩‍⚕️СВЕТЛАНА РЯБОКОНЬ\nопытный врач-апитерапевт с 30-летней практикой, выпускница мед.академии им. Мечникова (Спб)\n\n👨‍⚕️ЕВГЕНИЙ МОЛЧАНОВ\nмассажист, специалист по мягким мануальным техникам, восточным практикам, висцеральному массажу, посвящённый в Рейки, выпускник международной школы массажа, практикующий более 25 лет​\n\n📞Записывайтесь и будьте здоровы!\n💆‍♀️+79951880436 Евгений\n🐝+79181241968 Светлана\n❕Количество мест ограниченно\n\n800Р/любой сеанс жассажа или апирефлексотерапии. Pzm по текущему курсу на момент оплаты.\n1400Р/комплексный сеанс апи+массаж. Pzm по текущему курсу на момент оплаты.\n\nПриём по адресу Краснодар, ул. Карякина 18','https://i.ibb.co/9835sFN/file-72.jpg',0,'https://t.me/check_user_infobot?start=704498174',1582470000);
INSERT INTO `avtozakaz_pzmarket` VALUES (321214209,'1126','#продам','МАССОВАЯ РАССЫЛКА В ИНСТАРГАМ!','https://t.me/podrobno_s_PZP/1126','₽ / PZM','#Россия','@madamtatiana',0,'#услуги','фото','AgACAgIAAxkBAAKVxV5QHczCUQyp4vfUOBuHqwUiODfHAAKorzEbMQeBSslxn3Kz4CWZLjN6kS4AAwEAAwIAA3gAA6YmAAIYBA','https://t.me/podrobno_s_PZP/1126','одобрен','МАССОВАЯ РАССЫЛКА В ДИРЕКТ!🚀\n\nРасскажи о своём бизнесе тысячам потенциальных клиентов всего за сутки!😍\n\n\n⠀\n◾️Нет клиентов? Условно-бесплатные методы продвижения не приносят никакого результата?\n⠀\n✅Воспользуйся услугой массовой рассылки и твой инстаграм начнет продавать!⠀\n⠀\n⠀❗️ПОЧЕМУ ЭТО ТО, ЧТО ТЕБЕ НУЖНО? ❗️⠀\n⠀\n- Максимально тесный контакт с целевой аудиторией;⠀\n- Молниеносная скорость работы = быстрый отклик;⠀\n- Низкая стоимость;⠀\n- Прицельный удар по ЦА;⠀\n- НЕВЕРОЯТНЫЙ поток органического трафика.⠀\n⠀- Дешевле Таргета в несколько раз!\n\n⠀❗️ЗАКАЖИ РАССЫЛКУ И ПОЛУЧИ❗️⠀\n⠀\n- Новых живых подписчиков;⠀\n- Живую активность;⠀\n- Огромный поток лидов;⠀\n- Долгожданные продажи.⠀\n⠀\n⠀ ⠀\n⠀◾️Цена: от 30 копеек и за сообщение \n⠀\n⠀◾️Что входит:⠀\n- Сбор целевой аудитории Инстаграм с учётом Ваших требований (конкуренты, геолокация, хэштеги, по слову);⠀\n- Фильтрация базы (от ботов, коммерческих профилей и т.д);⠀\n- Консультация по созданию креатива для рассылки;\n- Рассылка.⠀\n⠀\nПодробнее о том,  как это работает и о сборе ЦА, при личном созвоне по телефону.\n⠀\n🚀 Прочитал до конца? \n\nЗначит, тебе это нужно! Не сомневайся! Напиши и сделай заказ уже сейчас!⠀\n⠀\nПо всем вопросам в ЛС @madamtatiana\n\nИнстаграм :\nhttps://instagram.com/tatika_s?igshid=1t595t6ns8snr\n\n\nМинимальный пакет всего 6 тыс.₽','https://i.ibb.co/XzjGZmC/file-74.jpg',0,'https://t.me/check_user_infobot?start=321214209',1582657269);
