INSERT INTO `avtozakaz_pzmarket` VALUES (1011351235,'1130','#продам','✨Консультация по Астрологии✨','https://instagram.com/marianna_vakhrusheva?igshid=1ebit1fho0c06','₽ / PZM','#Россия #украина #Анапа','@BabchuckAnton',0,'#услуги','фото','AgACAgIAAxkBAAKZzF5RD67wLDtuQ4kkn2SgxV8R9YDZAAJLrTEbFhuJSn-Nha1YhMkDwE-AkS4AAwEAAwIAA3gAAx4sAAIYBA','https://t.me/podrobno_s_PZP/1130','одобрен','Всем привет! 👋🏻\nМеня зовут Марианна, я Ведический астролог и консультирую более 7 лет. \n❗Многие скептически относятся к подобным знаниям, считая, что достаточно жить по совести. Да, это тоже очень важно. Но часто случается так, что и человек хороший, и жить старается правильно, но в жизни не клеится. Вот тут и стоит задуматься о карме, о неудачных периодах или неблагоприятном влиянии планет. Ведь не зря же в древности «прислушивались» и к Солнцу, и к Луне, - всё потому что планеты имеют сильное влияние на жизнь людей. \n🙏🏻Ведическая астрология помогает  разобраться, почему те или иные ситуации притягиваются в нашу жизнь, узнать своё предназначение, кармические долги, посмотреть совместимость с партнёром и многое другое!\n🌺Буду рада видеть Вас у себя в гостях инстаграмм @marianna_vakhrusheva , вк - https://vk.com/club153795867 где я делюсь интересной информацией, провожу розыгрыши, дарю подарки.','https://i.ibb.co/YZVdQrH/file-108.jpg',0,'https://t.me/check_user_infobot?start=1011351235',1594264369);
