INSERT INTO `avtozakaz_pzmarket` VALUES (496858878,'1137','#продам','Бесплатная консультация','https://t.me/podrobno_s_PZP/1137','PZM','#Весь_мир','@Ser_Mount',0,'#для_бизнеса','фото','AgACAgIAAxkBAAKbnV5SeavrCRXrOBYKMCw95gPGJv7EAAKMrDEbOA6RSlOdTaHZIPeW773CDwAEAQADAgADeAADH_sDAAEYBA','https://t.me/podrobno_s_PZP/1137','одобрен','БЕСПЛАТНЫЕ КОНСУЛЬТАЦИИ\n⠀\nДа, все верно! Я намерен провести 30 бесплатных консультаций!\n⠀\nЗачем мне это и по чем буду консультировать?\n⠀\nПроведя эти 30 консультаций - я помогу людям быстрее улучшить свои результаты!\n⠀\nЧто за консультации?\n⠀\n⚡️Таргет\n⚡️Маркетинг\n⚡️Упаковка соц.сети\n⚡️Стратегия достижения намеченного результата в Инстаграм и в количестве клиентов\n⠀\nКому консультации будут полезны?\n⠀\n☀️Владелицы бизнесов\n☀️Блогеры\n☀️Обычные ребята, что хотят начать свою деятельность в инстаграм\n☀️Маркетологи\n☀️Таргетологи\n☀️СММ-специалисты\n⠀\nПоэтому если я кого-то заинтересовал, то с удовольствием отвечу на все возникшие вопросы в Директ!\n\nВсем добра !','https://i.ibb.co/VYmYtDF/file-126.jpg',0,'https://t.me/check_user_infobot?start=496858878',1583590734);
INSERT INTO `avtozakaz_pzmarket` VALUES (1008240486,'1138','#продам','Продам софт','https://t.me/podrobno_s_PZP/1138','₽ / PZM','#Весь_мир','@Mr_Paramatrix',0,'#для_бизнеса','фото','AgACAgIAAxkBAAKbu15SmHvSE3BJQATKS1sXk0V4Z08PAAJ-rjEb4umYSsYOQxXWYiW8sV5JkS4AAwEAAwIAA3kAAx96AAIYBA','https://t.me/podrobno_s_PZP/1138','одобрен','#Продам софт ( бот ) с помощью которого можно находить любые ключевые запросы по Telegram. Работает как Google, находит, отслеживает ваши запросы и присылает уведомление. Благодаря боту вы сможете быстро, находить целевых клиентов под любые проекты, товары, а также находить любую информацию в Telegram. С помощью софта вы сможете сформировать список целевых чатов для рассылок, софт мониторит свыше 200 тысяч чатов. Использовать данную программу очень просто, все функции интуитивно понятны, достаточно одной минуты. Стоимость подобного софта 1290 рублей в месяц, я продаю за 25 PZM с возможностью использования постоянно и без ограничений. Писать @Mr_Paramatrix','https://i.ibb.co/Wvvd7Nn/file-127.jpg',0,'https://t.me/check_user_infobot?start=1008240486',1584944717);
INSERT INTO `avtozakaz_pzmarket` VALUES (388255687,'1139','#продам','Петля Глиссона','https://vk.com/pravilo_mira','₽ / PZM','#Весь_мир #Сочи #Россия','@pochaevm',1,'#красота_и_здоровье','фото','AgACAgIAAxkBAAKb7l5SofTM7RVc078XskveD7GXChBeAAJUrjEbVFSRSgGaS0I-eqQpAYLBDwAEAQADAgADeQADtMkEAAEYBA','https://t.me/podrobno_s_PZP/1139','одобрен','Петли Глиссона 😃 Сохраните ваш позвоночник здоровым❗\n \nВ современности проблемы с позвоночником встречаются практически у каждого в какой-то степени. Этому способствует сидячий образ жизни, неправильная осанка, мягкая постель, даже питание и психосоматика играют свою роль ☝🏻Но что же делать, когда у вас уже появилась, обострилась какая-то проблема с позвоночником: боли, “ноющее” чувство, покалывания и многие другие более серьёзные симптомы❓ \n \nНайдено решение😉На основе старинной практики растяжки шеи, описанной в кандидатских диссертациях учёных и рекомендованной в древности нашими предками, было создано замечательное весьма эффективное для вытяжки шеи средство - петля Глиссона🤗\n \nЧем же это полезно❓\n \n👉🏻Снятие усталости \n👉🏻Нормализация давления \n👉🏻Избавление от головокружений, мигрени \n👉🏻Улучшение сна \n👉🏻Стимуляция обмена веществ \n👉🏻Стабилизация функционирования шейных позвонков \n👉🏻Лечение остеохондроза, грыжи и других проблем с шеей \n Доставка по всему Миру \n3300₽ в призм по курсу','https://i.ibb.co/xMQngtS/file-128.jpg',1,'https://t.me/check_user_infobot?start=388255687',1594321739);
