INSERT INTO `avtozakaz_pzmarket` VALUES (228120948,'1145','#продам','Wi-Fi радар для поиска клиентов','https://t.me/podrobno_s_PZP/1145','₽ / PZM','#Екатеринбург #рф','@vtb27',0,'#для_бизнеса','фото','AgACAgIAAxkBAAKdL15ThSl69tF-LKEZpUxuNDNqAAH7OAADrTEbutCYSg1jcl3LhvajZ7p7kS4AAwEAAwIAA3kAA0U8AAIYBA','https://t.me/podrobno_s_PZP/1145','одобрен','Занимаюсь продажей Wi-Fi радаров по РФ. \nЧто умеет радар? \n-Соберёт адреса устройств в радиусе до 70 метров \n-Есть мобильное решение (без привязки к месту) для сбора аудиторий мероприятий, конференций, выставок.\n-Есть стационарное решение (для установки в Магазины, ТЦ, и т д.)\n-Собрав проходящий или проезжающий трафик можно настроить точечную Рекламную компанию.\n-Реклама по такой базе выходит значительно дешевле. \n\nРадар является трендом маркетинга 2019-2020 года и приведёт клиентов в ваш бизнес. \nНаходимся в Екатеринбурге, работаем по РФ. \nПроконсультирую по применению в личных сообщениях. Разберём ваши идеи и сферу применения на жизнеспособность использования Радара. \n\nСТОИМОСТЬ руб:\n\nГод: 45 000\n6 мес: 31 000\n3 мес 20 000 \n\nСТОИМОСТЬ PZM: \nГод: 1070 \n6 мес: 740 \n3 мес: 480 \n\nРасходы на транспортную компанию возьмём на себя. \n\nДля связи:\n@vtb27','https://i.ibb.co/Q6FtSv2/file-134.jpg',0,'https://t.me/check_user_infobot?start=228120948',1582531998);
