INSERT INTO `avtozakaz_pzmarket` VALUES (466833164,'1153','#продам','Сыродавленные масла','https://t.me/podrobno_s_PZP/1153','₽ / PZM','#весь_мир #Россия #Ярославль','@Sergey_Ilin76',0,'#продукты_питания','фото','AgACAgIAAxkBAAKfWV5U9XWqT4d5zMjYNqnc2oXhFj3PAAI3rDEbx7aoSlOF-M4HqPByc9OBkS4AAwEAAwIAA3gAA0VHAAIYBA','https://t.me/podrobno_s_PZP/1153','одобрен','Доброго дня! Предлагаю сыродавленные растительные масла первого холодного отжима на дубовом прессе. \n18 видов масла. \nОтборное сырье (в основном с Алтая)\nСамый экологичный способ отжима, сохраняющий 100% витаминов и полезных веществ в масле. \nОтжим происходит за 1 день до доставки, свежайшее. \nОчень полезно для здоровья, вкусно и экологично. \nТакого не купить в магазине!!!  \n100, 200 и 500 мл , есть подарочные наборы. \nДоставка по Ярославлю бесплатно, в другие регионы за счет покупателя. \nПринимаю оплату в призм по курсу. Цена: от 10 призм','https://i.ibb.co/8B1QzL2/file-142.jpg',0,'https://t.me/check_user_infobot?start=466833164',1593599686);
INSERT INTO `avtozakaz_pzmarket` VALUES (302772799,'1154','#продам','Напиток детокс IASO TEA.','https://t.me/podrobno_s_PZP/1154','$ / PZM','#весь_мир #Россия #Казахстан','@NatalyaMenkova',0,'#красота_и_здоровье','фото','AgACAgIAAxkBAAKfsl5VBPliqZk--tCf9nbR-fpHX9dyAAKzrDEbhYaoSndfdRr9XBy37gzBDgAEAQADAgADeQADTEwDAAEYBA','https://t.me/podrobno_s_PZP/1154','одобрен','#продам\nНапиток детокс\nЭто самый изысканный травяной очиститель для всего тела, из известных человеку. \nПрисоединяйтесь к тысячам людей, которые выбрали и наслаждаются вкусным, 100% натуральным напитком из трав, которые помогут и вам ...\n✅Произвести мягкую очистку всего организма, \n✅вывести шлаки,\n✅нормализовать стул, победить запоры, в том числе у детей, пожилых и инвалидов...\n✅Сбросить лишний вес, убрать пивной живот, уменьшить талию...\n✅Очистить пищеварительный тракт и улучшить усвоение питательных веществ и микроэлементов...\n✅Повысить энергию организма. Ваша активность повысится, появится удовлетворенность жизнью, будет больше радости...\n✅Намного уменьшится количество токсинов в крови ...\n✅Поможет побороть аллергии...\n✅Будут удалены из организма остатки лекарств, последствия пассивного курения, никотина и тяжелые металлы ...\n✅Постепенно будут очищены толстая и тонкая кишки, почки, печень, кровь и легкие станут здоровым и чистым ... ✅✅✅И многое, многое другое, поскольку это способствует оздоровлению желудка и функционированию толстой кишки!\n\nЦена 60$ - курс на 5 недель. /PZM по курсу на день покупки.\n@NatalyaMenkova','https://i.ibb.co/86h27TM/file-143.jpg',0,'https://t.me/check_user_infobot?start=302772799',1582630173);
INSERT INTO `avtozakaz_pzmarket` VALUES (797691966,'1156','#продам','Временная регистрация, прописка!','https://t.me/podrobno_s_PZP/1156','₽ / PZM','#Сочи','@Ruslan_Ugo',0,'#услуги','фото','AgACAgIAAxkBAAKf815VmtZecRv_ASYXnaADUkaoYkQOAAJbrTEbJa6oSq0pbAKALXUd4xfBDgAEAQADAgADeAADxFIDAAEYBA','https://t.me/podrobno_s_PZP/1156','одобрен','Сочи! Временная регистрация, постоянная прописка. Сроки: от трёх месяцев до пяти лет. Районы: лазаревский, центральный, хостинский, адлерский. Для ипотеки/кредитов. Для мед. учреждений, садов/школ, оформления авто (ГАИ), СУДов и т.д. Буду рад помочь!Все официально.\nРасчет в PZM или ₽.','https://i.ibb.co/gF5ZVGt/file-145.jpg',0,'https://t.me/check_user_infobot?start=797691966',1582756576);
INSERT INTO `avtozakaz_pzmarket` VALUES (508431933,'1157','#продам','АУДИ А7 2010 г.в.','https://www.avito.ru/sochi/avtomobili/audi_a7_2010_1434617870?utm_campaign=native&utm_medium=item_page_android&utm_source=soc_sharing_seller','₽ / PZM','#Сочи','@Alexabmbit',0,'#транспорт','фото','AgACAgIAAxkBAAKgJl5WAXHRX5yqn9Js72M_t3aTk4fOAAJWrTEbqruxSmNlzZNCVaEKamtcDwAEAQADAgADeQAD-_YFAAEYBA','https://t.me/podrobno_s_PZP/1157','одобрен','Продаю свой любимый автомобиль. Очень надёжный немец. Ни разу ни где не подводил. За то время пока управляю поменял тормозные диски и стойки стабилизатора. Ездил сам, поэтому машина в порядке и вложений не требует. Продавать не хочется, но приходится. По пустякам просьба не тревожить, а тем кто знает что такое Ауди и любит комфорт + скорость дам возможность поторговаться. Машина ни чем не отличается от той, которая сейчас в салоне стоит более 5 000 000 рублей. Все подробности по телефону.','https://i.ibb.co/fDVrWWY/file-146.jpg',0,'https://t.me/check_user_infobot?start=508431933',1582694848);
INSERT INTO `avtozakaz_pzmarket` VALUES (528521692,'1203','#продам','ЧЕХОЛ ДЛЯ ТЕЛЕФОНА','https://t.me/podrobno_s_PZP/1203','₽ / PZM','#Россия','@lidiadobr',0,'#личные_вещи','фото','AgACAgIAAxkBAAKgSF5WC11nCZdTh76TSzKtU_2th2f_AAICrDEbJW2wSt8ivmJLBmkyziV3kS4AAwEAAwIAA3kAA6xKAAIYBA','https://t.me/podrobno_s_PZP/1203','одобрен','ЧЕХОЛ ДЛЯ ТЕЛЕФОНА\nС функцией поглощения электромагнитных колебаний\n⠀\nОПИСАНИЕ\nУйти с радаров с новым аксессуаром \nЧехол полностью защитит Ваше здоровье и частную жизнь! Он блокирует распространение не только радиоволн, обеспечивающих мобильную связь, но и электромагнитные колебания, отвечающие за Wi-Fi соединение, Bluetooth и т.п. С ним Вы защитите не только себя, но и свои кредитные карты.\nЗащитная система внутри чехла блокирует доступ новейшим сканерам и ридерам киберпреступников, перехватывающих приватную информацию и практикующих новые способы кибермошенничества.\nЭкранирующий чехол работает по принципу клетки Фарадея.\nВ 19 веке физик придумал, как сделать так, чтобы на аппаратуру не воздействовали внешние электромагнитные поля. Электромагнитный контур замыкается клапаном с металлизированной тканью. Принцип клетки Фарадея работает, образуя единый замкнутый контур, за который не пробиваются радиоволны от других мобильных телефонов, вышек ретрансляторов.\nЕсли положить смартфон в наш экранированный кожаный чехол и плотно закрыть его клапан, то становится невозможным триангуляция вашего телефона и отслеживание его различными спецсредствами. В этом случае, также, по нему невозможно будет прослушать о чём вы беседуете со своими партнёрами. Во время важной встречи вас не побеспокоят отвлекающими звонками. И для этого не надо выключать телефон.\nЧерез этот кожаный чехол проходит сплошное полотно со специальными защитными свойствами, образуя своеобразный щит. Через него не проходит сигнал. По тактильным ощущениям очень трудно определить, что ваш кожаный футляр снабжён экранирующим металлизированным материалом.\nХарактеристики:\nРазмер: 10x17 см.\nМатериал: искусственная кожа\nЦвет: чёрный, белый, красный, коричневый\n\nх Цвет чехла вы можете выбрать при согласовании заказа с менеджером.','https://i.ibb.co/GpjdZqn/file-25.jpg',0,'https://t.me/check_user_infobot?start=528521692',1583452062);
INSERT INTO `avtozakaz_pzmarket` VALUES (928747358,'1159','#продам','#транспорт','https://t.me/podrobno_s_PZP/1159','₽ / PZM','#Москва','@AndrLeht',0,'#транспорт','фото','AgACAgIAAxkBAAKgj15WMmxK773I-nfx8fKBIj9LXn31AAKwrDEb_E6wSj9QRXq3cQGXuFPLDgAEAQADAgADeQADY7ECAAEYBA','https://t.me/podrobno_s_PZP/1159','одобрен','год выпуска 2010\n\nПробег 157​ 019​ км\n\nКузов внедорожник 5 дв.\n\nЦвет чёрный\n\nДвигатель 3.0 л / 224​ л.с. / Дизель\n\nКоробка автоматическая\n\nПривод полный\n\nРуль Левый\n\nСостояние Не требует ремонта\n\nВладельцы 3 или более\n\nПТС Дубликат\n\nТаможня Растаможен\n\nVINWDC1648221A62709','https://i.ibb.co/M8wqyV6/file-148.jpg',0,'https://t.me/check_user_infobot?start=928747358',1582707566);
INSERT INTO `avtozakaz_pzmarket` VALUES (740442324,'1158','#продам','Масло кедровое (алтайский кедр)','Алтай-рядом.рф','₽ / PZM','#Весь_мир #Россия #Тольятти','@a_reineg',0,'#продукты_питания','фото','AgACAgIAAxkBAAKgl15WMoTNrpLkGF2ykmglyLsyMpKMAAIarDEbXKmxSlGCqH901fv14KnCDwAEAQADAgADeQADEuUEAAEYBA','https://t.me/podrobno_s_PZP/1158','одобрен','Масло кедровое (алтайский кедр).                                              \nДля производства используется алтайское ядро и только дубовый пресс. Контакт с металлом полностью отсутствует, в качестве фильтра используются тиковые мешки. Осадок минимальный.                                           Фасовка в ПЭТ: 0.5 л. и 1 л.                                                                                                                                           Стоимость 1250 руб./0,5л. (по курсу Prizm)\nСтоимость 2400 руб./1 л. (по курсу Prizm)\nБарнаул\nСайт - Алтай-рядом.рф\nВопросы по заказу -@a_reineg','https://i.ibb.co/JpjNvXs/file-147.jpg',0,'https://t.me/check_user_infobot?start=740442324',1597560140);
INSERT INTO `avtozakaz_pzmarket` VALUES (388255687,'1160','#продам','Доска с гвоздями','https://vk.com/pravilo_mira','₽ / PZM','#Россия #Весь_мир #Сочи','@pochaevm',1,'#красота_и_здоровье','фото','AgACAgIAAxkBAAKgyl5WVqRAZXS8KYVAciSnJU8DtiwyAAKprjEb8dmxSqFE694DW-d-FrHCDwAEAQADAgADeQAD3g8EAAEYBA','https://t.me/podrobno_s_PZP/1160','одобрен','Доска Садху.\nЧто даёт стояние на гвоздях?\nНа наших ногах и руках есть акупунктурные точки всего тела. \nКогда вы стоите на гвоздях, то активизируете эти точки.\nТакже это очень психологическая тренировка!\nДоска Садху, имеет размеры 300×150 или 350×150.\n📍Ее удобно и безопасно хранить.\n📍Она будет незаменима в любой поездке, походе или оздоровительном мероприятии, ведь она компактна и безопасна при транспортировке.\n📍Межгвоздевое расстояние 10мм. или 15мм.\n📍Оцинкованная сталь\nЗаказывайте доску с рисунком или без. Можно сделать рисунок на выборх🤝\nхцену в этом случае нужно уточнить\nстоимость 5500 руб. с доставкой по России\nза PZM по курсу\n@pochaevm','https://i.ibb.co/Vxnmyq4/file-149.jpg',1,'https://t.me/check_user_infobot?start=388255687',1588321980);
INSERT INTO `avtozakaz_pzmarket` VALUES (157440519,'1161','#продам','Массажёр TOPRELAX (Ю.Корея)','https://t.me/podrobno_s_PZP/1161','PZM','#Краснодар','@voroninpro',0,'#красота_и_здоровье','фото','AgACAgIAAxkBAAKhB15WsLp-XzSss59M56nI6qmog1FBAAISrDEbUy6JSuuB0NZDMeWLLid3kS4AAwEAAwIAA3gAA4ArAAIYBA','https://t.me/podrobno_s_PZP/1161','одобрен','⭐Меняю всего лишь на 1300  PRIZM⭐\n\nМногофункциональный вибромассажер Regeneration TR III - лучшее в мире оборудование для ежедневного ухода за позвоночником в домашних условиях.\n\n❗Основой оздоравливающего воздействия является массаж, осуществляемый соленоидным механизмом и инфракрасное тепло нефрита. Дополняют его Нано-Турмалин с отрицательно заряженными ионами и природное магнитное поле.\n❗В основе ежедневного ухода - вибрационное воздействие, которое способствует снятию спазм мышц, возникающего из-за недостатка движения. Это вибрационное воздействие подобно первоклассному массажу у вас дома, каждый день.\n\n💯ИННОВАЦИОННАЯ ТЕХНОЛОГИЯ ухода за позвоночником.\n\nВ Regeneration TR III воплощено все, чтобы качественный уход за позвоночником стал доступен каждому, каждый день, в удобное время, не выходя из дома.\n\n🔆Совместите полезное с приятным, наслаждайтесь расслабляющим массажем дома и с комфортом.\nЕжедневное, систематическое применение оборудования станет незаменимым помощником в пути не только к сохранению здоровья, но и к полноценному, насыщенному долголетию.\n\n✅Отличный подарок своему здоровью и здоровью своих близких!\n \n🔴Предложение ограничено!\n\n💣1300 PZM\n\nЗвонить: +79298485909','https://i.ibb.co/vzxJbjJ/file-150.jpg',0,'https://t.me/check_user_infobot?start=157440519',1582739956);
INSERT INTO `avtozakaz_pzmarket` VALUES (674469011,'1162','#продам','Игрушки ручной работы🌸','https://www.instagram.com/plush_toys_nika?r=nametag','₽ / PZM','#Весьмир #Россия #Анапа','@plush_toys_nika',0,'#хобби_и_отдых','фото','AgACAgIAAxkBAAKhXV5XZpSxvvCtNa_mcI_wA8-0nQRjAAIxrjEbydi5SqjszyN0EsKkMHVcDwAEAQADAgADeQADvwgGAAEYBA','https://t.me/podrobno_s_PZP/1162','одобрен','​​Игрушки ручной работы🧸.\nВ наличии и на заказ.\nМягкие и приятные на ощупь, из качественных материалов. Игрушки отправляются в красивой подарочной крафт- упаковке🎁.\nДоставка Почтой России. Доставка оплачивается отдельно по тарифам почты.Оплата в Prizm- по курсу в день покупки или в рублях.\n\nМишка белый.Рост 24 см -800 руб,\nМышка в фиолетовом платье. Рост 24 см-800 руб\nЗайка в розовом платье. Рост 32 см -1500 руб,\nБарашек мятного цвета.Рост 25 см-850 руб,\nКит. Длина 21 см- 500 руб.\n\nСвязь со мной🧸:\nТелеграм-\nhttps://t.me/plush_toys_nika\nИнстаграм- https://www.instagram.com/p/B4fIa5vINmu/?igshid=7nuphq5kt8rn','https://i.ibb.co/wKdZZmX/file-151.jpg',0,'https://t.me/check_user_infobot?start=674469011',1584774172);
INSERT INTO `avtozakaz_pzmarket` VALUES (381306885,'1163','#продам','Элитная парфюмерия','https://t.me/podrobno_s_PZP/1163','PZM','#Россия #СНГ #Оренбург','@Natalya7501',0,'#красота_и_здоровье','фото','AgACAgIAAxkBAAKh0V5Xfb9yZGJIatxgDXPRQAOouSFOAAI6rjEb2LG5SieO9W5eXAq_qL3CDwAEAQADAgADeQADgBQEAAEYBA','https://t.me/podrobno_s_PZP/1163','одобрен','Женские и мужские ароматы, созданные парфюмерами завода Argeville (Франция). Коллекция \\\"Classic\\\" включает в себя ароматы, отвечающие современным трендам, а также те, которые созвучны идеям, ставшим классикой. Эксклюзивная авторская коллекция  \\\"Voyage d\\\"Amour\\\" создана по философии самых известных городов мира. \\\"Jardin de Fleur\\\"- восхитительные духи с цветочным ароматом.  Селективная парфюмерия \\\"Emploi\\\" - высокое парфюмерное искусство, самые модные тенденции.  \nПарфюмерия Armelle – это чистое звучание, раскрытие в три ноты.  🔹Стоимость:  1 500 - 2 500 рублей (обмен на монеты PRIZM по курсу на момент покупки).\n🔹Доставка почтой России или любым удобным способом.\n    Наталья, телефон: +79619290175   VK https://vk.com/id24417736\n🔹Телеграмм: @Natalya7501','https://i.ibb.co/4MxxWms/file-152.jpg',1,'https://t.me/check_user_infobot?start=381306885',1600413971);
INSERT INTO `avtozakaz_pzmarket` VALUES (971086199,'1165','#продам','Знаки зодиака из Ясеня','https://t.me/podrobno_s_PZP/1165','₽ / PZM','#Россия #Челябинск','@ostrom74',0,'#для_дома_и_дачи','фото','AgACAgIAAxkBAAKh9V5Xgaw3MES8gYvK4Eb8Z8XO1nAaAAIBrDEb1b25St6Eyz9XwuV0VZNykS4AAwEAAwIAA3kAA9lVAAIYBA','https://t.me/podrobno_s_PZP/1165','одобрен','Знаки зодиака - поточная система генерации личной жизненной энергии. В наличии все знаки. Материал - Ясень, берёза, дуб, сосна. Диаметр 380 мм. Прекрасный оригинальный и неординарный подарок. Несёт восстанавливающий эффект для организма человека соответствующего дня рождения. Стоимость: 2500 - 3000 руб. в зависимости от материала. Оплата как в рублях, так и в ПРИЗМ.  Доставка за счёт покупателя, транспортными компаниями из Челябинска. +7-919-33-777-19. @ostrom74.','https://i.ibb.co/XzvYhqw/file-154.jpg',1,'https://t.me/check_user_infobot?start=971086199',1582798101);
