INSERT INTO `avtozakaz_pzmarket` VALUES (908962514,'1176','#продам','Котёл электродный','https://t.me/podrobno_s_PZP/1176','₽ / PZM','#Россия #Пермь','@murinav48',0,'#для_дома_и_дачи','фото','AgACAgIAAxkBAAKlml5agBpjO_ajcB-mI3xNDBx7f4s9AAJSqzEb-ibASgPo56kWuxRzD2dcDwAEAQADAgADbQADvL0BAAEYBA','https://t.me/podrobno_s_PZP/1176','одобрен','Для отопления дома до 120 м2. Котёл НОВЫЙ, однофазный, 220 В, мощность 4-6 кВт, настраивается индивидуально сопротивлением теплоносителя. Теплоноситель-концентрат в комплекте.Котел «Градиент» имеет коэффициент преобразования электрической энергии в тепловую равный 2, поэтому 1кВт на 20м2.\n Технология получения такого эффекта является НОУ-ХАУ. Гарантия 1 год со дня ввода в эксплуатацию. Затраты отобъет за сезон!!! Цена с завода без терморегулятора 24.000.\nПри покупке дешёвых котлов типа Галан вам придется ещё закупать теплоноситель, который обойдется в зависимости от объема системы от 12.000 и выше. Со временем электро сопротивление жидкости падает и эффективность котла соответственно. В нашем случае при падении сопротивления носителя добавляется концентрат, перемешивается в системе что приводит к экономии расхода на замену теплоносителя и электроэнергии.\nhttps://www.avito.ru/perm/remont_i_stroitelstvo/kotel_katodnyy_6_kvt_s_teplonositelem_1075718606?utm_campaign=native&utm_medium=item_page_android&utm_source=soc_sharing_seller','https://i.ibb.co/vv8D5NM/file-0.jpg',1,'https://t.me/check_user_infobot?start=908962514',1598778959);
