INSERT INTO `avtozakaz_pzmarket` VALUES (491301322,'1178','#продам','GPS GLONASS трекер УМКа310 (новый)','https://t.me/podrobno_s_PZP/1178','PZM','#Россия','@IronRoger',0,'#транспорт','фото','AgACAgIAAxkBAAKl6F5arnD53vW9oSDpNLgWT1IXSNqhAALUrDEbV7bYSpjMS0mfc1Nq48PCDwAEAQADAgADeAADgSoEAAEYBA','https://t.me/podrobno_s_PZP/1178','одобрен','Терминалы УМКа310 – компактные бюджетные устройства, оптимальные для решения базовых задач спутникового мониторинга.\n\nУстройства могут передавать координаты и другие навигационные данные в облачную платформу ГЛОНАССсофт или любой другой хостинг, имеющий открытый протокол, в том числе протокол EGTS, используемые в системе «ЭРА-ГЛОНАСС». Как и УМКа301, УМКа310 способны одновременно передавать данные на 3 сервера.\n\nБлагодаря пакетному способу передачи данных на базе открытого бинарного протокола Wialon Combine, УМКа310 имеет низкий расход трафика на фоне высокой частоты и большого объема передаваемых данных.\n\nНастройка и управление терминалом происходит через SMS, GPRS или Bluetooth 4.0.\n\nПомимо функции мониторинга местоположения, скорости и направления движения ТС, в УМКа310 также реализована возможность получения данных о расходе топлива (опционально доступна поддержка интерфейса RS-485 для подключения 1-3 ДУТ).','https://i.ibb.co/jgK3vgS/file-1.jpg',0,'https://t.me/check_user_infobot?start=491301322',1583001256);
