INSERT INTO `avtozakaz_pzmarket` VALUES (217601768,'1190','#продам','Daewoo Nexia в отличном состоянии','https://t.me/podrobno_s_PZP/1190','₽ / PZM','#Россия #Ростов_на_Дону #Таганрог','@AndrewKrivous',0,'#транспорт','фото','AgACAgIAAxkBAAKpLl5eepgmqf0MC1bAdCQKn6Xz5IfDAAI_rTEb6fn5SpROKiSLnB1Zl_zADgAEAQADAgADeQADSIwDAAEYBA','https://t.me/podrobno_s_PZP/1190','одобрен','Нексия в очень достойном состоянии для своих лет. Топовая комплектация, приемистый двигатель. Честный пробег, 8 лет ездил дедушка, 7 месяцев была у второго владельца, третьим стал я. Покупал как временный автомобиль для передвижения по работе. Продаю по причине покупки нового авто. \nАвтомобиль полностью в родной краске. Замена масла и всех фильтров каждые 10000 км. \nПолностью новая ходовка по кругу, спереди установлены баферы, новый вентилятор печки, устранены болячки контактной группы и света фар. Денег для авто не жалел, в ближайшее время кроме стандартных расходников вложений не потребует. \nВ этом ценовом диапозоне лучше навряд ли что-то найдете. Небольшой торг уместен.  \nhttps://roy.market/item/5e5e66d674804a0024319710','https://i.ibb.co/FxqHWhw/file-13.jpg',0,'https://t.me/check_user_infobot?start=217601768',1583250100);
INSERT INTO `avtozakaz_pzmarket` VALUES (928747358,'1191','#продам','Porsche Cayenne 3.0 AT, 2013','https://t.me/podrobno_s_PZP/1191','₽ / PZM','#Москва','@AndrLeht',0,'#транспорт','фото','AgACAgIAAxkBAAKpSV5ehTqi4LAGGxUWe24PFbQ8MG9-AAJqrDEb583wSqZXBBXMXWhkF25MkS4AAwEAAwIAA3kAA2vIAAIYBA','https://t.me/podrobno_s_PZP/1191','одобрен','выпуска 2013\n\nПробег 117​ 000​ км\n\nКузов внедорожник 5 дв.\n\nЦвет коричневый\n\nДвигатель 3.0 л / 245​ л.с. / Дизель\n\nКоробка автоматическая\n\nПривод полный\n\nРуль Левый\n\nСостояние Не требует ремонта\n\nВладельцы 1​ владелец\n\nПТС Оригинал\n\nВладение 6 лет и 2 месяца\n\nТаможня Растаможен\n\nОбмен Рассмотрю варианты\n\nVINWP1ZZZ92ZELA39802\n\nПТС оригинальный !\n\nСостояние НОВОГО автомобиля (даже запах)!\n\n1 собственник (записей в ПТС две - Мама и сын).\n\nДва ключа !\n\nПо ПТС - 2013 год !\n\nДва комплекта резины в отличном состоянии (зима и лето) !\n\nКуплен в декабре 2013 года.\n\nОбслуживался у официального дилера Порше (есть подтверждающие заказ-наряды) !\n\nКрашенных деталей - нет!\n\nПосле покупки новых красивых дисков R20 или R21 - цена повысится на их стоимость. Примерно 100.000₽.\n\nОчень богатая комплектация:\n- расширенная отделка кожей\n- пневмо подвеска\n- Keyless go\n- Webasto\n- камера заднего вида\n- 14 диапазонные сиденья с памятью и вентиляцией\n- пакет «Спорт Хроно», не «Компас»\n- пакет «Свободные руки»\n- многофункциональные сиденья\n- память пассажирского сиденья\n- память водительского сиденья\n- климат контроль для задних пассажиров\n- вентиляция сидений\nИ многоe другое..\n2 300 000 т. р. /PRIZM','https://i.ibb.co/Qk8yPks/file-14.jpg',1,'https://t.me/check_user_infobot?start=928747358',1583253019);
INSERT INTO `avtozakaz_pzmarket` VALUES (908962514,'1192','#продам','Стол журнальный авторский','https://t.me/podrobno_s_PZP/1192','PZM','#Россия #Пермь','@murinav48',0,'#для_дома_и_дачи','фото','AgACAgIAAxkBAAKphl5emCDog7DSMP9H8eGDlMhyQQ-EAALmqzEb1kzYShYr52t-_Q_9FP3ADgAEAQADAgADeQAD_24DAAEYBA','https://t.me/podrobno_s_PZP/1192','одобрен','Эксклюзивные столы ручной работы, выполнены из цельного ствола ели и из колец ствола, состаренные по древней технологии, тоннели жука короеда натуральные. Столы единственные в своём роде. Основание и полка из ильма, диаметр 400 мм, высота 600 мм, столешница каленое стекло 10мм диаметр 900 мм\nhttps://trk.mail.ru/c/phjpd1?id=5e39143265bcf13ee6258e12','https://i.ibb.co/gtBmyWG/file-15.jpg',1,'https://t.me/check_user_infobot?start=908962514',1598147759);
INSERT INTO `avtozakaz_pzmarket` VALUES (124473010,'1193','#продам','Продам Hyundai Santa Fe 2.7 AT, 2007','https://t.me/podrobno_s_PZP/1193','₽ / PZM','#уфа #Башкортостан #россия','@plazmoza',0,'#транспорт','фото','AgACAgIAAxkBAAKpx15fP5PESghE7skGPhOKuWSipQ0-AALJrjEbrzv5SnhOYcGWmUZ25vfADgAEAQADAgADeQADEo0DAAEYBA','https://t.me/podrobno_s_PZP/1193','одобрен','Продам надежный авто в отличном состоянии. 10000 км назад сделал капиталку двигателя. Полностью отремонтировали холовую. Сменил все жидкости, ролики, ремни, свечи. Сел и поехал. Есть недочеты по кузову. На фото в принципе все видно. Два комплекта колес на литых дисках зима лето. Салон серая кожа. Салон в отличном состоянии. В салоне не курили. Красил все пластиковые элементы, т.к. краска с пластика облетает со временем. Так же красил заднее левое крыло и дверь багажника. Автомат не пинается, движок тянет как сумашедший. Расход 92 бензина 15 л на 100 км зимой по городу, летом падает до 12 л. Есть возможность перейти на газ. Звоните заранее, на авто передвигаюсь. Обмен не интересует. Торг у капота.','https://i.ibb.co/vvMpdyv/file-16.jpg',0,'https://t.me/check_user_infobot?start=124473010',1585477997);
INSERT INTO `avtozakaz_pzmarket` VALUES (943187989,'1195','#продам','Регрессы - глубинные проработки.','https://vk.com/vedasphere','₽ / PZM','#Весь_мир #Россия #Москва','@Makosh108',0,'#услуги','видео','BAACAgIAAxkBAAKqi15fjnFewMSHIaEFAq46s77YuFo-AAJmBQACtP35Ss1MxnZjKNR_GAQ','https://t.me/podrobno_s_PZP/1195','одобрен','Регрессы - глубинные проработки детских травм, неправильных убеждений, блоков. 2 часа - 5000 рублей. Услугу можно приобрести за PRIZM.\n\nСо 100% гарантией результата. Дорого. Качественно.\nС чем работает мой студент: взаимоотношения с собой(негатив, привычки, неуверенность), с противоположным полом, с деньгами, с родоками, кривые сценарии жизни - вам 30-50, а мужика нет и семьи нет, денег нет, или всё это есть, а счастья нет.\n\nСсылка на полный видео отзывы: https://vk.com/video-55729127_456239103\n\nПисать: @vasilii_man','',0,'https://t.me/check_user_infobot?start=943187989',1583320842);
INSERT INTO `avtozakaz_pzmarket` VALUES (908962514,'1196','#продам','Интерьерная чаша из сувеля','https://t.me/podrobno_s_PZP/1196','₽ / PZM','#Россия #Пермь','@murinav48',0,'#для_дома_и_дачи','фото','AgACAgIAAxkBAAKq0V5gBILJnRUc72rBi0R2PPy5QtzuAAL6rDEbJEAAAUsiM9dFfjyEASO-wg8ABAEAAwIAA3kAA6pSBAABGAQ','https://t.me/podrobno_s_PZP/1196','одобрен','Изготовлена вручную, сохранены элементы корнепластики живого дерева, габаритные размеры 880х660х300 мм. Интерьерная чаша для ценителей натурального дерева и дизайнеров. Покрыта прозрачным глянцевым полиуретановым лаком.\n63.000 рублей по курсу Pzm','https://i.ibb.co/ZM15pS2/file-18.jpg',1,'https://t.me/check_user_infobot?start=908962514',1583351286);
INSERT INTO `avtozakaz_pzmarket` VALUES (244875994,'1197','#продам','“Шаверма bar”','https://t.me/podrobno_s_PZP/1197','₽ / PZM','#Россия #краснодарский_край #сочи','@MAKSIM_KUSKOV',0,'#для_бизнеса','видео','BAACAgIAAxkBAAKq-l5gKmMkU1baSGN4CPKmnITTuMIqAALMBAACpaeJS78h1DdLq5jNGAQ','https://t.me/podrobno_s_PZP/1197','одобрен','СРОЧНО!!! Продаю готовый действующий бизнес в центре Сочи. В высокопроходимом месте по ул. Воровского 4 (Курортный проспект, Платановая аллея). Много офисов и магазинов. Приносит прибыль круглый год. Достойная аренда для центра города и такого заведения. Кафе-бар не быстрого питания, работает 2,5 года.  Лофт дизайн. Находится в цокольном этаже, что имеет преимущество-хорошая шумоизоляция.  Отличное место как для шумных посиделок, так и для спокойного отдыха , просмотра спортивных трансляций, проведение небольших мероприятий, игры, а так же устраивать вечера живой музыки (квартирник), караоке.\n  Площадь заведения 60кв.м-включает в себя зал для гостей 30кв.м (ЕНВД), туалет, кухня, бар(активный ). 7 посадочных столов внутри заведения, 4-на улице,так же установлена барная стойка, стоят стулья. \nК продаже предлогаем самую вкусную шаурму в Сочи, снеки, пиво, салаты, супы,  б/а напитки. В кафе имеется все для автоматизированной работы:\n-меню\n-контакты поставщиков\n-охранная и пожарная сигнализация от компании \"Дельта\".\n-видеокамеры\n-онлайн касса-программа Poster (оплачена на год вперёд ).\n-ЕГАИС\nА так-же всё необходимое для работы оборудование и посуда. В смене работают 2человека.\n Из рекламы:\n-уличный проектор\n-уличная стойка меню\n-страница в инстаграмм @vorovskogo4\n-2Gis\n-Google\n-TripAdvisor\n-рекламная компания Citi life\n-доставка Яндекс.Еда\n-рекламные визитки с правом на седьмую бесплатную шаверму.\n-постоянные клиенты.\nДоходы показаны через программу, подробности при встрече. \nНе риэлтор. \nПриходите, пробуйте, звоните.\n\n1500000₽ или по курсу PRIZM\n\n@MAKSIM_KUSKOV','',0,'https://t.me/check_user_infobot?start=244875994',1584600595);
