INSERT INTO `avtozakaz_pzmarket` VALUES (508431933,'1199','#продам','🔥Криптовалютная карта PRIZM🔥','https://t.me/podrobno_s_PZP/1199','₽ / PZM','#вся_россия #сочи #москва','@Alexabmbit',0,'#личные_вещи','фото','AgACAgIAAxkBAAKre15g5R76MD44IyBPQCQm5IAlFuBmAALprDEbAW6YSoqrF4iolUnCpCrBDgAEAQADAgADeQADbkgDAAEYBA','https://t.me/podrobno_s_PZP/1199','одобрен','🔥Криптовалютная карта PRIZM🔥\nПервая партия ОГРАНИЧЕНА, из-за вируса не так много придет✅\nЦена: 120$. Нет никаких наценок!\nДоставка 5-6 дней. В Сочи можно забрать у нас в офисе на улице Роз','https://i.ibb.co/SsCm8fD/file-20.jpg',0,'https://t.me/check_user_infobot?start=508431933',1583408460);
INSERT INTO `avtozakaz_pzmarket` VALUES (1036778640,'1201','#продам','Тюльпаны на 8 Марта','https://telegra.ph/tyulpany-optom-i-v-roznicu-03-05','₽ / PZM','#москва #московскаяобласть','@tulpanich',0,'#услуги','фото','AgACAgIAAxkBAAKsFl5hK2pJreflMX-8Zxxuh202YJ9PAALHrTEbamAIS1yZ8Ubs3MagnvTADgAEAQADAgADeQADNKMDAAEYBA','https://t.me/podrobno_s_PZP/1201','одобрен','Хотите поздравить маму, любимую женщину, подругу или коллег на 8 марта?\n\nПри этом не хотите тратить много денег на цветы, время на поиски и вовремя получить свой заказ?\n\nТогда Вам точно к нам!\n\nПоможем сделать лучший выбор, сэкономить время и деньги. Приобретая цветы у нас, вы не переплачиваете посредникам и получаете свежие цветы высшего качество по оптовым ценам в самый разгар весенних праздников.\n\nВ этом году мы вырастили для Вас более 15 сортов замечательных Голландских тюльпанов, наши флористы уже в боевой готовности для формирования Ваших заказов и оперативной доставки к двери.\n\nНаши тюльпаны яркие, с плотным стеблем и пышными контрастными бутонами различных сортов , а так же только у нас:\n\nБолее 15 сортов в наличии\nВысота тюльпанов 40-60 см\nВысота бутонов не менее 5 см\nЛучшее соотношение цены и качества\n\nЭкспресс доставка.\nОплата наличными, переводом, безналичный расчет.','https://i.ibb.co/g739rGz/file-23.jpg',0,'https://t.me/check_user_infobot?start=1036778640',1583426643);
