INSERT INTO `avtozakaz_pzmarket` VALUES (528521692,'1209','#продам','Фильтр для воды «Граф»','https://t.me/podrobno_s_PZP/1209','₽ / PZM','#Россия #Владивосток','@lidiadobr',0,'#для_дома_и_дачи','фото','AgACAgIAAxkBAAKt4V5izlzZgIYbbojbG3jZuGDFQPW5AAJ5rzEbf8oZS5jfpwxX76Vg16fCDwAEAQADAgADeQADZ0AFAAEYBA','https://t.me/podrobno_s_PZP/1209','одобрен','Фильтр для очистки воды Graf – это залог Вашего здоровья и долголетия.  Он очищает воду от вредных примесей, при этом сохраняя микроэлементы и все ее полезные свойства, даже усиливая их.\n\nGraf - единственный в своем роде фильтр-кувшин, не имеющий аналогов! \nОсновой фильтрующего элемента (картриджа) кувшина является Графен - УСВР (углеродная смесь высокой реакционной способности), которая не только очищает воду от органических и неорганических загрязнителей, но и придаёт ей активные биологические свойства.\n\nУглеродная смесь высокой реакционной способности и технология её производства были созданы академиком В. И. Петриком путем научного открытия «Явление образования наноструктурных углеродных комплексов», заверенного Международной ассоциацией авторов научных открытий в 2001 году, Диплом №163.\n\nУСВР является новым веществом определенного класса, не имеющим аналогов в мире по физическим, химическим, функциональным и экономическим характеристикам, а также экологической чистоте.\n\n〰️ресурс сменного картриджа фильтр-кувшина Graf составляет 600–1000 литров, менять картридж каждые 3-6 месяцев от состояния воды . \n\nЭто не просто чистая вода - это вода дающая жизненные силы!\n\nА теперь ВНИМАНИЕ АКЦИЯ!!! \nПри бесплатной регистрации купи 1 кувшин Граф+ Второй получаете в подарок!!!','https://i.ibb.co/5sb4fcJ/file-31.jpg',0,'https://t.me/check_user_infobot?start=528521692',1583533837);
INSERT INTO `avtozakaz_pzmarket` VALUES (756759632,'1210','#продам','Активатор воды Акваспектр.','https://t.me/podrobno_s_PZP/1210','₽ / PZM','#Россия','@Ognennyy',0,'#красота_и_здоровье','фото','AgACAgIAAxkBAAKuAV5jBx-jB_eCRjtWuHGZXMGPN4vyAALxrDEbcscYS6e-U5DPiL_Z7SHBDgAEAQADAgADeAADNKUDAAEYBA','https://t.me/podrobno_s_PZP/1210','одобрен','Устанавливаете дома\n\nНаслаждаетесь чистой щелочной водой. \n\nПовышаете тонус и здоровье всего организма. \n\nАктиватор делает живую воду для всей вашей семью убирая соли тяжёлых металлов, хлор и прочих. \n\nДелает окислительные свойства, ОВП по составу схожим на кровь человека. \n\nВ итоге нет затрат энергии, тело впитывает такую воду ещё в ротовой полости. \n\nЭто крайне выгодное приобретение, которое по достоинству оценят экономные хозяйки – аппарат не требует дальнейших финансовых затрат и будет служить вам долгие годы!\n\nЗаходите и заказывайте\nИли пишите в личку по предоплате через кошелёк призм.\n\nПо промокоду Google (специально создан для призмаркет) делаем скидку если оплачиваете в рублях через сайт https://oplata.aquaspectr.com\nПриз. Действуйте','https://i.ibb.co/G9t35kZ/file-32.jpg',0,'https://t.me/check_user_infobot?start=756759632',1590304464);
