INSERT INTO `avtozakaz_pzmarket` VALUES (908962514,'1222','#продам','Горные слёзы 60 г.','https://t.me/podrobno_s_PZP/1222','₽ / PZM','#Весь_мир #Россия #Пермь','@murinav48',0,'#красота_и_здоровье','фото','AgACAgIAAxkBAAKyBV5oir-Flek_qP3bMSaPDYV7TT0jAAJkrDEbBpNJS6gx8WM56924BvnADgAEAQADAgADeAADVdcDAAEYBA','https://t.me/podrobno_s_PZP/1222','одобрен','Одним из самых высокоэффективных средств народной медицины считается так называемые Горные слёзы. Это уникальное природное средство обладает массой целебных свойств, оказывает оздоравливающее, профилактическое, восстанавливающее и иммуномодулирующее действие, являясь при этом отличным антисептиком и анальгетиком. Нет такого заболевания, при котором этот минеральный продукт не смог бы помочь.\nhttps://ru.prizmbarter.com/Для-дома/Здоровье-красота/Биологически-активное-вещество-Горные-слёзы-60-г_i23','https://i.ibb.co/yBPJZp2/file-43.jpg',1,'https://t.me/check_user_infobot?start=908962514',1591985974);
INSERT INTO `avtozakaz_pzmarket` VALUES (339546344,'1223','#продам','Петля Глиссона','https://yogstore.ru/petlya_glissona/tproduct/139352574-476480065970-shapka-glissona-130kg','₽ / PZM','#Пенза #Россия #весьмир','@SvetlanaKuzina',0,'#красота_и_здоровье','фото','AgACAgIAAxkBAAKyzV5p_rH6B-Pt-gu3t4SChYCMGERUAAKCrTEbfu5RSzn4DFerCR1fV5rCDwAEAQADAgADeQADy3kFAAEYBA','https://t.me/podrobno_s_PZP/1223','одобрен','Шапка Глиссона (130кг)\nДля здоровья шейного отдела позвоночника и не только\n2 000р. 2 300р.\nПетля Глиссона (60кг)\nВариант петли, выдерживающий нагрузку до 60кг.\n1 200р. 1 490р.\nАльфа гравити\nДля устранения зажимов в мышцах и здоровья суставов\nГамак для ног\nдля комфортной работы за столом\nв подарок при покупке гамака для йоги\n1 190р.\nКоврик для йоги ( не скользит)\nВыберите цвет, высоту и количество\n990р. 1 490р.\nШапка Глиссона (130кг)\n2 000р. 2 300р.\nУдобный и комфортный вариант петли, не имеющий аналогов в России. Делает практику не только полезной, но и приятной для головы в местах соприкосновения.\n\nЭта старинная практика растяжки шеи описана во многих авторитетных источниках от кандидатских диссертаций учёных до мудрых советов наших предков в былинах и сказаниях.\n\nШапка простая в применении:\n- дома или после бани;\n- в длительных поездках или походах с рюкзаком;\n- очень эффективный и безопасный способ снять усталость;\n\nОна поможет, если Вы периодически испытываете дискомфорт связанный с:\n- давлением;\n- головокружением;\n- мигренями;\n- плохой сон и многое другое.\n\nПетля Глиссона нашла применение при таких патологиях шейного отдела, как:\n- остеохондроз; \n- выбухание и подвывихи позвонков; \n- компрессия (сдавливание) дисков; \n- ригидность (повышенный тонус, зажатость) мышц; \n- грыжи. \n\nПетля Глиссона — ценное подспорье для всех, чья работа постоянно связана с компьютером, поскольку длительная статичная поза у монитора провоцирует развитие шейного остеохондроза. Как свидетельствуют отзывы пользователей тренажера, вскоре проходят боли, улучшается зрение, укрепляется память. \nЭто великолепный подарок близким и себе для долголетия и гармонии в теле!\nПетля Глиссона, Йога🧘‍♂️🧘‍♀️гамаки собственного производства и десятки других товаров на сайтах https://yogstore.ru/ и https://yogagamak.ru \nБесплатная доставка по РФ. Опт и розница. Изготовление от 1 дня!\nГруппа ВК - https://vk.com/yogamac\n🔥Много полезного на нашем YouTube канале Йогика:🔥\nhttps://youtu.be/44YmJcJ_-i0 https://youtu.be/xwENkvbwmEA\nтел. 8 8003338589 и Viber / WhatsApp/ Telegram 89093222030\nyogikarf@gmail.com','https://i.ibb.co/4fzc29Q/file-44.jpg',1,'https://t.me/check_user_infobot?start=339546344',1584615223);
