INSERT INTO `avtozakaz_pzmarket` VALUES (276523231,'1244','#продам','Сессии ACCESS BARS','https://www.instagram.com/p/B9z42CgHllf/?igshid=1nvzbiqpfia6a','₽ / PZM','#ростовнадону #таганрог #ростов_на_дону','@olga_chad',0,'#услуги','фото','AgACAgIAAxkBAAK4sl5ymxu0-onHg03DyNRWLPBhJJ0sAAJSsDEb6XKQSxQsy-iUwSqNgqB1kS4AAwEAAwIAA3gAAxMlAQABGAQ','https://t.me/podrobno_s_PZP/1244','одобрен','❓Устали жить как белка в колесе?\n❓ Все вокруг раздражает? \n❓Все время что-то мешает добиться своей цели? \n🤚 ОСТАНОВИСЬ 🤚\nА чего ты хочешь на самом деле?\nЯ приглашаю тебя на сеансы \n💆‍♀️ ACCESS BARS 💆‍♀️, где:\n✨Освободимся от негативных эмоций\n✨Уберем из подсознания твои ограничивающие установки и убеждения\n✨восстановим твои энергетические ресурсы\n✨Запустим процессы, позволяющие найти необходимые решения по твоим запросам\n✨Научимся чувствовать наши истинные желания.\nБолее подробно https://www.instagram.com/p/B9z42CgHllf/?igshid=1nvzbiqpfia6a\nЗапись по телефону:\n89286282812 Ольга','https://i.ibb.co/2k6R7gn/file-66.jpg',0,'https://t.me/check_user_infobot?start=276523231',1584569291);
INSERT INTO `avtozakaz_pzmarket` VALUES (980519464,'1245','#продам','Услуги Репетитора','https://t.me/podrobno_s_PZP/1245','₽ / PZM','#весь_мир #Россия','@Oksana_GW',0,'#услуги','фото','AgACAgIAAxkBAAK5bF50XyQSGX1LcBRQ4NbFJw9-2o4fAALmrDEbFGSoSwp--I8dC9MKech-kS4AAwEAAwIAA3gAA_cxAQABGAQ','https://t.me/podrobno_s_PZP/1245','одобрен','​​•Услуги репетитора. Математика, физика. \nОнлайн и оффлайн. \n✅Разовые встречи для разбора темы (!особенно актуально при дистанционном обучении!), \n✅регулярные занятия. \nА также новое предложение:\n✅Школьное сопровождение по предмету удаленно (проверка домашнего задания и разбор темы по необходимости).\n\n•₽/PZM оплата 1000 руб/час, за сопровождение оплата помесячная 10 тыс/мес. В PZM по текущему курсу.\n\n• Живу в #Екатеринбург, работаю с любой точкой мира на русском языке.\n\n•@Oksana_GW','https://i.ibb.co/HKhCtpW/file-67.jpg',0,'https://t.me/check_user_infobot?start=980519464',1601026949);
INSERT INTO `avtozakaz_pzmarket` VALUES (384679141,'1246','#продам','Уроки английского языка','https://t.me/podrobno_s_PZP/1246','$ / PZM','#весьмир','@JuliaPrizm',0,'#услуги','фото','AgACAgIAAxkBAAK55151EzdzQPUpNE2vQKCGDpXgIWrMAALBrTEbfYmoS2rO5QJCSpubL0zLDgAEAQADAgADeQAD4pcDAAEYBA','https://t.me/podrobno_s_PZP/1246','одобрен','Преподаватель английского языка с большим опытом работы. Высшее педагогическое образование.\nОпыт работы 12 лет.\nСертифицированный преподаватель/эксперт ОГЭ и ЕГЭ\nCELTA \nРабота индивидуально и в группах.\nОбучение по скайпу, разные возрастные группы.\nПодготовка к ЕГЭ и ОГЭ. \nНайду подход к каждому студенту.\nЗвоните/пишите, отвечу на все Ваши вопросы более подробно.','https://i.ibb.co/41LfzPj/file-68.jpg',0,'https://t.me/check_user_infobot?start=384679141',1587023724);
INSERT INTO `avtozakaz_pzmarket` VALUES (983218109,'1247','#продам','Полиграф - ПОЛИСКОР-01','https://t.me/podrobno_s_PZP/1247','₽ / PZM','#весь_мир #Россия #Ростов_на_Дону','@lelik1984',0,'#для_бизнеса','фото','AgACAgIAAx0CT0V26QACXBdedfg9DywnZmNjTy6Dw44EZf4p8gACY60xG5zasUsg3JRACdKTJrJfSZEuAAMBAAMCAAN5AANyfQEAARgE','https://t.me/podrobno_s_PZP/1247','одобрен','Полиграф ПОЛИСКОР - 01, 2019 года, состояние новое, датчик АД, датчик ФПГ, датчики верхнего и нижнего дыхания, датчик КГР, тремор(подушка). Возможен небольшой торг. Состояние новый, полностью исправен, проверил на нем всего лишь 10 человек, продаю за ненадобностью т.к устроился на постоянную работу.','https://i.ibb.co/58P28mL/file-70.jpg',0,'https://t.me/check_user_infobot?start=983218109',1584789405);
INSERT INTO `avtozakaz_pzmarket` VALUES (453772122,'1248','#продам','Защитные маски','https://t.me/podrobno_s_PZP/1248','₽ / PZM','#Россия','@andreyartv',0,'#красота_и_здоровье','фото','AgACAgIAAxkBAAK6xl53PtckYkI1RsHElrQWxnB35_kOAAL9qzEbiN24S6oLzm4YpyjcPk6AkS4AAwEAAwIAA3kAA5hIAQABGAQ','https://t.me/podrobno_s_PZP/1248','одобрен','Маска защитная многоразовая собственное производство.\n\nПроизводим маски защитные из 100% хлопка:\n- 2 слоя\n- эластичная тесьма\n- многоразовое использование\n- удобный анатомический крой, максимально закрывающий носоглотку со всех сторон\n\n3 размера: детский, женский, мужской\n\nРекомендации по уходу:\n- рекомендуемая длительность ношения маски не более 2-3 часов;\n- сменить маску в случае увлажениня или загрязнения;\n- повторное использование только после стирки и глажки утюгом с 2 сторон при максимальной температуре;\n- иметь маску с собой на смену.\n\nОт500шт-80₽\nОт1000шт-60₽\nОт1500шт-40₽\n\n\nОтправка ТК, либо СДЭК по всей россии. Наличный и безналичный рассчет.','https://i.ibb.co/Ryy901N/file-71.jpg',0,'https://t.me/check_user_infobot?start=453772122',1585047119);
INSERT INTO `avtozakaz_pzmarket` VALUES (135189572,'1249','#продам','Перкуссионный массажер','https://t.me/podrobno_s_PZP/1249','₽ / PZM','#Россия #Екатеринбург','@bzdongl',0,'#красота_и_здоровье','фото','AgACAgIAAxkBAAK66153aJW-GN8uzfmFlHmoJJLqHN-UAALdrjEbRq-4Sy0LkkLwCtwa2FvLDgAEAQADAgADeQADCagDAAEYBA','https://t.me/podrobno_s_PZP/1249','одобрен','Мышeчный масcaжер - этo портативноe, рaботающее нa аккумуляторе, пpoфecсиональнoe перкуcсионноe тepапeвтичeскoe уcтpoйство, кoтopоe oбеспечивает глубoкий удapный маcсaж для уменьшeния боли в мышцax и сустaвах. \nOcнащeн peгулиpуeмыми углaми для тpуднодоступных мест и выполняет следующее:\nУсиливает кровоток и лимфоток;\nРазрушает рубцовую ткань;\nУменьшает количество молочной кислоты,\nАктивирует нервную систему и мышцы;\nВосстанавливает нервную систему\n\nГораздо эффективнее, чем ручной массаж благодаря его уникальной калиброванной частоте, амплитуде и крутящему моменту. \nМассажер обеспечивает тот же эффект, что и глубокий массаж тканей, но с меньшей болью или давлением, потому что скорость (частота) перекрывает болевые сигналы в мозге.','https://i.ibb.co/tQVNkPJ/file-72.jpg',1,'https://t.me/check_user_infobot?start=135189572',1590223094);
INSERT INTO `avtozakaz_pzmarket` VALUES (908962514,'1250','#продам','Мёд с Горными слезами','https://t.me/podrobno_s_PZP/1250','₽ / PZM','#Россия','@murinav48',0,'#красота_и_здоровье','фото','AgACAgIAAxkBAAK7Kl53j0XjWbmXIulFDfKH5Bs4rT4JAAKsrDEbfMrAS8XEtJRjSMzdaUPCki4AAwEAAwIAA3kAA_ELAAIYBA','https://t.me/podrobno_s_PZP/1250','одобрен','Разработаны, исследованы, опробованы и произведены лечебно-профилактические препараты на основе натурального мёда, черники и БАВ(биологически-активные вещества), в состав которых входят натуральный дофаминовый меланин, горные слезы, липиды, антиоксиданты, флавоноиды, полисахариды, аминокислоты, витамины и многие другие полезные и крайне жизненно необходимые полезные вещества. Все вещества входящие в состав лечебно-профилактических препаратов являются натуральными, безопасными, нетоксичными и экологически чистыми веществами не дающие при потреблении никаких отрицательных и побочных эффектов.\nРазработаны и произведены 2 линейки препаратов по 3 наименования в каждой линейке. Первая - препараты содержащие БАВ в каждом препарате, предназначена для людей ведущие активный образ жизни 18-60 лет. Данная линейка препаратов поднимает иммунную систему и удерживает ее на уровне по 1 группе здоровья, поднимает жизненный тонус человека до спортивного состояния.\nВторая – с содержанием БАВ, предназначена для потребления детям от 7-17 лет и людям преклонного возраста, имеющих проблемы со здоровьем. Эта линейка препаратов работает более мягко и приводит иммунитет человека в умеренную 2ю группу здоровья, что не перегружает организм и плавно оздоравливает его и поднимает жизненный тонус.\nДанные препараты рекомендованы и хорошо показали себя при восстановлении после инсультов, инфарктов перенесенных операций и других тяжелых заболеваний(гепатиты, грипп, циррозы, туберкулезы).\nТак же данные препараты являются профилактическими против всевозможных вирусных заражений, препятствуют новообразованиям: доброкачественным и злокачественным опухолям, препятствуя онкозаболеваниям, разрушают свободные радикалы, так как имеют в своем составе антиоксиданты и флавоноиды. Данные препараты ощелачивают организм, очищают кровь, а так же приводят в движение и чистку лимфосистемы, которую часто не принимают во внимание при лечении врачи.\nhttps://ru.prizmbarter.com/Для-дома/Здоровье-красота/Мед-с-Горными-слезами-200-г_i28','https://i.ibb.co/Dbnj95m/file-73.jpg',0,'https://t.me/check_user_infobot?start=908962514',1589011307);
INSERT INTO `avtozakaz_pzmarket` VALUES (674950467,'1251','#продам','Новые свадебные платья!!!','https://t.me/podrobno_s_PZP/1251','₽ / PZM','#Хакасия,\n#Тыва, #Абакан','@Olegyam1977',0,'#личные_вещи','фото','AgACAgIAAxkBAAK7Vl53plNalWECO42oHctKDXzabkD1AAItrDEbGlfBS9if8YUwh4Ds0HfBDwAEAQADAgADeQADWuUFAAEYBA','https://t.me/podrobno_s_PZP/1251','одобрен','​​​​Новые свадебные, детские выпускные, вечерние платья оптом и в розницу. Производство Беларусь. Выбор свыше 2000 видов платьев любого размера от 44-62 на любой кошелёк. Также имеются свадебные туфли более 50 видов, бижутерия, аксессуары, кольца на машину. Всё это Вы можете посмотреть на нашей страничке в инстограмме #liubovkakhnii','https://i.ibb.co/ZMGHJmB/file-74.jpg',0,'https://t.me/check_user_infobot?start=674950467',1590597912);
INSERT INTO `avtozakaz_pzmarket` VALUES (464878437,'1252','#продам','Jaguar XJ III (X350X358)','https://t.me/podrobno_s_PZP/1252','₽ / PZM','#Весь_мир #Россия #Сочи','@vorsix',0,'#транспорт','фото','AgACAgIAAxkBAAK7u154cmoXPmVpdVfWoVGFxNwdtFidAAIxrDEblZ7JS5vzLBQ8yULVxlHFki4AAwEAAwIAA3kAA9gPAAIYBA','https://t.me/podrobno_s_PZP/1252','одобрен','Роскошный автомобиль в отличном состоянии за приемлемые деньги.\nПокрыт жидким стеклом, что даёт эффект новизны и свежести.\nУстановлено газовое оборудование. Салон свежий и чистый без серьёзных потёртостей. Все расходники менялись 300 км. назад.\nХодовая часть и двигатель в прекрасном состоянии. Во время моего пользования в ДТП не попадал, по предыдущим хозяевам ничего сказать не могу.\nАвтомобиль стоит на учёте в Армении.\nОт пользования автомобилем только положительные эмоции: отличные ходовые и динамические характеристики, комфортный салон с богатой отделкой в сочетании с 400-сильным двигателем и завораживающим внешним видом делают этот автомобиль лучшим в данной ценовой категории.\nОбслуживание и цена деталей удивляют своей низкой стоимостью.\nЦена: 64000 PZM или 530000 рублей.','https://i.ibb.co/k4TBvjY/file-75.jpg',1,'https://t.me/check_user_infobot?start=464878437',1584952432);
INSERT INTO `avtozakaz_pzmarket` VALUES (139580850,'1253','#продам','Варган 🦅Перо🦅','https://www.instagram.com/p/B9_zxDfituM/','₽ / PZM','#Весьмир #Россия','@Monkey_bike',0,'#хобби_и_отдых','фото','AgACAgIAAxkBAAK8Al54fSHfrxHyYjfT0YoSuimWxKJ0AAJHrDEb1h7AS9dptQQofoB_zmXBDwAEAQADAgADeAADke0FAAEYBA','https://t.me/podrobno_s_PZP/1253','одобрен','🔔Средне-басовый звук. \n☑️Уровень: начинающий и профи. \n🧘🏻‍♂️Для импровизаций, медитаций, музыкальных тренировок, хорошего настроения. \n✨Вы можете приобрести его в деревянном кейсе. \n4500₽','https://i.ibb.co/Kw2kdxV/file-76.jpg',0,'https://t.me/check_user_infobot?start=139580850',1584954784);
INSERT INTO `avtozakaz_pzmarket` VALUES (674469011,'1256','#продам','Игрушки ручной работы🧸','https://www.instagram.com/plush_toys_nika?r=nametag\n\nhttps://t.me/plush_toys_nika','₽ / PZM','#Весьмир #Россия #Анапа','@plush_toys_nika',0,'#хобби_и_отдых','фото','AgACAgIAAxkBAAK8qV557svp0GahvPa3TiY_eQNHdxbuAAK9rTEbQS3RS08DjQEnRbMkyCZ3kS4AAwEAAwIAA3kAAyBbAQABGAQ','https://t.me/podrobno_s_PZP/1256','одобрен','Игрушки ручной работы🧸.\nВ наличии и на заказ.\nМягкие и приятные на ощупь, из качественных материалов. Игрушки отправляются в красивой подарочной крафт- упаковке🎁.\nДоставка Почтой России. Доставка оплачивается отдельно по тарифам почты.Оплата в Prizm- по курсу в день покупки или в рублях.\n\nПчелёнок Рой.\nРост в сидячем положении 26 см - 1500 руб,\nЗайка в розовом платье. Рост 32 см -1500 руб,\nМишка белый.Рост 24 см -800 руб,\nМышка в фиолетовом платье. Рост 24 см-800 руб\nБарашек мятного цвета.Рост 25 см-850 руб,\n\n\nСвязь со мной🐝:\nТелеграм-\nhttps://t.me/plush_toys_nika\nИнстаграм- https://www.instagram.com/p/B4fIa5vINmu/?igshid=7nuphq5kt8rn','https://i.ibb.co/TcTXzdS/file-79.jpg',0,'https://t.me/check_user_infobot?start=674469011',1597907547);
INSERT INTO `avtozakaz_pzmarket` VALUES (235805138,'1257','#продам','Консультация соматиполога','https://t.me/podrobno_s_PZP/1257','PZM','#Россия','@blago2552',0,'#услуги','фото','AgACAgIAAxkBAAK81V56BjqK40Q9TSonMtoaQa035hEhAAJyrDEbZjTQS_sLFXg9zHr2YSTBDgAEAQADAgADeAADMGAEAAEYBA','https://t.me/podrobno_s_PZP/1257','одобрен','Почему большинство людей занимаются не своим делом?\nПрепятствий для этого у каждого из нас очень много.\nЖить в соответствии со своим предназначением удаётся только\nвезунчикам.\nНет действенных методик, которые позволяют\nпонять таланты и способности человека в раннем возрасте.\nОднако мы можем обратиться к себе, к своей сути (суфии это называ-\nли сущностью) и, познав себя, всё же найти своё место в жизни.\nСущность определить можно путём научной методики Константина Шадрина.\n Определив свой соматип, свои подсознательные ценности, одну из\nпяти сил, управляющих миром, вы сможете определиться с профессией\nи правильно поставить цели.\nБлагодаря знанию основных частей своей личности, вы узнаете, какой\nваш талант принесёт вам настоящее богатство, лёгкость и свободу.\nВы получите мощный заряд энергии и вдохновения для решительных дей-\nствий.\n\nВ письменном заключении — информация о вас, о ваших сущностных\nкачествах, об особенностях вашей личности и о том, как именно вам\nстать успешнее и богаче, — чего я вам искренне желаю!','https://i.ibb.co/hFJzD0Q/file-80.jpg',0,'https://t.me/check_user_infobot?start=235805138',1585056638);
