m/club82424893 или директ instagram.com/romanov.officearbitr/?hl=ru)  Так же по телефону   +7 (917) 658-44-39, +7 (952) 475-40-16 \n2. Обсуждение вашего вопроса, оценка объемов и сроков работ\n3. Подписание договора и оплата\n4. Выполнение работ согласно договора','https://i.ibb.co/PNVks3p/file-118.jpg',0,'https://t.me/check_user_infobot?start=518146558',1587282721);
