INSERT INTO `avtozakaz_pzmarket` VALUES (518146558,'1306','#продам','юридические услуги','https://vk.com/club82424893','₽ / PZM','#Чебоксары #Казань #Йошкар_Ола','@Roverist71',0,'#услуги','фото','AgACAgIAAxkBAALKE16NcoI7vu4agzZw5oanJoiBJp6KAAJjrTEbCxtwSApp3QFzjrdTNIYDki4AAwEAAwIAA3gAAz0GAAIYBA','https://t.me/podrobno_s_PZP/1306','одобрен','Практикующий юрист с семилетним опытом Алексей Геннадьевич готов оказать юридическую помощь жителям Чебоксар, Н-Новгорода, Казани, Йошкар-Олы по следующим направлениям права:\n\n1. Имущественные споры (взыскание долгов, возмещение ущерба);\n\n2. Семейные споры (развод, раздел имущества, алименты, споры о детях);\n\n3. Жилищные споры (выписка из квартиры, выселение, вселение);\n\n4. Банкротство физ лиц (сохранение имущество которое не будет входить в конкурсную массу при банкротстве);\n\n5. Арбитражные споры (взыскание дебиторской задолженности, работа по корпоративному праву, сопровождение юр. лиц);\n\n6. Дела об административных правонарушениях (так же споры по возвращению водительских прав).\n\nА также:\n- юридическую помощь в составлении документов (договоры, претензии, иски);\n\n- представление интересов в судебных инстанциях (составление искового заявления, жалоб, участие в судебном заседании);\n\n- консультации по исполнительному производству.\n\nШирокий спектр бухгалтерских услуги:\n- подготовка и сдача отчетности;\n\n- консультации по бухгалтерскому учету;\n\n- бухгалтер удаленно.\n\nСтоимость услуги определяется после анализа документов и зависит от сложности вопроса.\n\nУстные консультации оказываются БЕСПЛАТНО. Задать вопрос можно по телефону +7 (917) 658-44-39                          или написать сообщение в группе:                                                                                                                                                            https://vk.com/club82424893                                                                                                                                                                                   https://www.facebook.com/legalcompanylawyer                                                                                                                                             или оставить сообщение в директ: https://www.instagram.com/romanov.officearbitr/?hl=ru','https://i.ibb.co/tzpthLT/file-132.jpg',0,'https://t.me/check_user_infobot?start=518146558',1587817062);
