INSERT INTO `avtozakaz_pzmarket` VALUES (918215841,'1363','#продам','Участки под строительство','https://t.me/podrobno_s_PZP/1363','€ / PZM','#Весь_мир #Украина','@s1evgen',0,'#недвижимость','фото','AgACAgIAAxkBAALZ7l6nOrZjPUBzOnrMiRae68mSSaSPAALcrjEbylU4SZX_s0Qf26pbaIXuki4AAwEAAwIAA3kAAyG4AAIZBA','https://t.me/podrobno_s_PZP/1363','одобрен','Участки под строительство ул.Черниговская,48, ул.Бульварная, 59,61\n1424284700:02:000:01451424284700:02:000:01441424284700:02:000:03811424284700:02:000:0380\n\nПродажа элитных участков  в Славянске, общей площадью 0,428 га в непосредственной близости от центра микрорайона Артема (детские сады, школы, рынок, университет, поликлиника  кафе  рестораны,  фитнес центр т.д.). Всего четыре участка, лучшее предложение для покупателя – купить весь комплекс: 42 сотки.\nДанные участки - идеальный вариант для  бизнес - и индивидуального строительства, возможные варианты:\n-       организация кафе-ресторана, детской площадки, природного ландшафта;\n-       организация детской железной дороги +кафе + природный ландшафт (экзотические растения, горки, речка, мостики, водопады и т.д.);\n-       торгово-развлекательный комплекс;\n-       современные всесезонные теплицы +жилой дом;\n-       организация питомника экзотических растений  + жилой дом +бассейн;\n-       наземная солнечная электростанция по зеленому тарифу;\n-       и другие варианты.\n\n Тел. 0661514271\n\n1424284700:02:000:0145, - 8.8 сотки, ул.Бульварная, 61, пос. Мирный,  (микрорайон Артема), г.Славянск, Украина;\n\n 1424284700:02:000:0144, -14 соток, ул. Бульварная, 59, пос. Мирный,  (микрорайон Артема), г.Славянск, Украина;\n\n 1424284700:02:000:0381, -5 соток, ул. Черниговская, 48-а, пос. Мирный,  (микрорайон Артема), г.Славянск, Украина;\n\n 1424284700:02:000:0380, - 15 соток, ул. Черниговская, 48-а, пос. Мирный (микрорайон Артема), г.Славянск, Украина','https://i.ibb.co/6NJSh05/file-189.jpg',0,'https://t.me/check_user_infobot?start=918215841',1593285378);
INSERT INTO `avtozakaz_pzmarket` VALUES (254974135,'1364','#продам','Продаётся земельный участок','https://t.me/podrobno_s_PZP/1364','₽ / PZM','#Россия #СергиевПосад','@DmitryMoskvitin',0,'#недвижимость','фото','AgACAgIAAxkBAALaUV6nicGh3quKNP_7thuVebWhZmJLAALbrTEbJEJASV4yl7srgsZLA7DCDwAEAQADAgADeQAD1FYGAAEZBA','https://t.me/podrobno_s_PZP/1364','одобрен','Собственник.Продаётся земельный участок. 65 км.от МКАД по Ярославскому шоссе.Рядом озеро Торбеевское.                                                                                                                                \n ДНП\"Солнечный-2\", граничит с деревней Козицино и Дубинино, Березняки. До Сергиева Посада 15 км. Удобный круглогодичный подъезд.Асфальт до участка,зимой дороги чистят.                                 \nДНП окружено забором,круглосуточная охрана. На въезде шлагбаум. Удобно добираться и общественным транспортом.                                                                                                                                     С Ярославского вокзала электричка до \"пл.81км\" (1час 15мин), далее пешком мин 10-15. Летом работает магазин.                                                                                                                                               \n   Земли сельскохозяйственного назначения для дачного строительства с правом возведения жилого дома с правом регистрации проживания в нем. Точные координаты участка: 56.366527, 38.250961. \nс кадастровым номером 50:05:0120245:747, по адресу: установлено относительно ориентира, расположенного в границах участка. Почтовый адрес ориентира: обл. Московская, муниципальный р-н Сергиево-Посадский, сельское поселение Березняковское, д. Дубининское, центральная часть кадастрового квартала 50:05:0120245\nТакже интересует обмен на Авто. Торг уместен. Стоимость 100 000 pzm.','https://i.ibb.co/7CxhgzD/file-190.jpg',0,'https://t.me/check_user_infobot?start=254974135',1588038147);
