INSERT INTO `avtozakaz_pzmarket` VALUES (963026721,'1407','#продам','Кофейное оборудование','https://t.me/podrobno_s_PZP/1407','₽ / PZM',' #Россия #Москва','@Ivangallery',0,'#для_бизнеса','фото','AgACAgIAAxkBAALqzF7MyyozlSLcJsi_uUwhFYN6bP2qAAJmrjEbzl9pSry0zt5mpzG_eXzjkS4AAwEAAwIAA3kAA6lhAgABGQQ','https://t.me/podrobno_s_PZP/1407','одобрен','Кофейное оборудование комплект.\nВы планируете открыть кофе на вынос, кофейню? Отличное предложение для вас по соотношению цены и качества: кофе машина 2 группы с полуавтоматическим проливом (профессиональные Бариста поймут), производительность до 360 чашек/час, большой 10 литровый бойлер обеспечит необходимым количеством пара для капучино и кипятка для американо. Так же в комплекте электронная кофемолка Fiorenzato F64E с сенсорным дисплеем, обеспечит вас свежемолотым кофе непосредственно в холдер, а так же полным контролем продаж эспрессо напитков. \nЦена за комплект всего 100к руб или по курсу PZM. \nКофеоборудование полностью подготовлено к работе и оттестированно нашими специалистами. \nОборудование для кофейни работает как от системы водоснабжения, так и от бутыля. \nВозможно доставка, установка и дальнейшее техническое сопровождение нашими специалистами. \nТак же в наличии все необходимые товары для работы Бариста.\nБольшой выбор оборудования для всех типов заведений. Индивидуального подбор и консультация, учитывая технические требования, бренд и планируемый бюджет. \nРемонт кофемашин всех брендов. Полный спектр услуг, запчасти и средства профилактики.','https://i.ibb.co/KyDmt0j/file-236.jpg',1,'https://t.me/check_user_infobot?start=963026721',1603864889);
