INSERT INTO `avtozakaz_pzmarket` VALUES (388255687,'1409','#продам','Купи свой автомобиль за 35','http://finiko-club.ru/','₽ / PZM',' #весь_мир','@pochaevm',1,'#услуги','фото','AgACAgIAAxkBAALrP17NE0CeUbwFZEN2ldFLgMXDqSX4AAJ4rTEb9zRpSqpnsOmT2dDwzTS_ki4AAwEAAwIAA3gAA817AgABGQQ','https://t.me/podrobno_s_PZP/1409','одобрен','Реальная покупка нового автомобиля за 35% от стоимости!\n⠀\nЕсли вы планируете приобрести себе авто за 3 000 000 млн рублей, то вам нужно оплатить:\n⠀\n🚗35% - это 1 050 000 рублей\n🚗1% - от суммы приобретаемого авто - 30 000 рублей\n🚗10 000 рублей - договор обслуживания\n🔥Итоговая сумма к оплате будет составлять 1 090 000 рублей!\n⠀\nМеханизм заключения договора:\n35%- оплата клиентом от суммы автомобиля\n65% это сумма, выплачиваемая компанией Finiko в счёт покупки автомобиля.\n13% - это налог на доход физического лица (рассчитывается от 65%)\n⠀\nИнтуитивно понятный интерфейс и привычная механика заключения договоров будет расчитывать покупку автомобиля за 120 дней с возможностью оплатить налог на доход.\n⠀\n🤗 уже через 120 дней вы становитесь обладателем автомобиля 🔥💃🚗\n⠀\n⁃ Модель и комплектация о которой мечтали ВЫ!\n ⁃ Без автокредита!\n ⁃ Автомобиль не находится в залоге у банка!','https://i.ibb.co/KmsKpvS/file-238.jpg',0,'https://t.me/check_user_infobot?start=388255687',1590498193);
