INSERT INTO `avtozakaz_pzmarket` VALUES (7,'','#продаю','Чай прессованный ','','PZM  / PZM','#Россия','chay-fenix',0,'#продукты_питания','фото','','','','Натуральный прессованный чай в кубиках для заварочных чайников. \n \n* В состав входят только полноценный листовой чай и настоящие, качественные ингредиенты (ягоды, фрукты и цветы); \n* используются исключительно качественное и свежее сырье; \n* индивидуальная упаковка каждого кубика с наклейкой - удобство хранения и использования; \n* удобство в учете - 1 кубик - 1 чайник, отличная идея для использования в ресторане, кафе, дома или в офисе; \n* скорость заваривания чая в кубиках в 2 раза быстрее россыпного. \n* вес одного кубика – 6-7 грамм; \n* для объёма чайника 500-600 гр.','',0,'https://teleg.link/ALexeySLavyanin',1591402229);
INSERT INTO `avtozakaz_pzmarket` VALUES (521002396,'1418','#продам','Чай прессованный','https://vk.com/chay_v_cubikah','PZM',' #Россия','@ALexeySLavyanin',0,'#продукты_питания','фото','AgACAgIAAxkBAALvDF7a4Yz_eOncvwWns6Pm5mSL6uxtAAIXrTEbEUkAAUrE5iLbsqytgdYS3pMuAAMBAAMCAAN5AAMRcAACGgQ','https://t.me/podrobno_s_PZP/1418','одобрен','Натуральный прессованный чай в кубиках для заварочных чайников. \n \nх В состав входят только полноценный листовой чай и настоящие, качественные ингредиенты (ягоды, фрукты и цветы); \nх используются исключительно качественное и свежее сырье; \nх индивидуальная упаковка каждого кубика с наклейкой - удобство хранения и использования; \nх удобство в учете - 1 кубик - 1 чайник, отличная идея для использования в ресторане, кафе, дома или в офисе; \nх скорость заваривания чая в кубиках в 2 раза быстрее россыпного. \nх вес одного кубика – 6-7 грамм; \nх для объёма чайника 500-600 гр.\n\nПри заказе от 3ёх упаковок чайный блин в подарок.','https://i.ibb.co/sK8DVQk/file-250.jpg',0,'https://t.me/check_user_infobot?start=521002396',1591403069);
INSERT INTO `avtozakaz_pzmarket` VALUES (7,'','#продаю','консультации психолога','','PZM','#Весь мир','sagrada',0,'#услуги','фото','','','','Кабинет психолога – это безопасное пространство. В нём есть место для выражения всех чувств, которыми Вы переполнены. В этом пространстве нет места осуждению, оценкам. Здесь есть возможность исследовать свою жизнь, искать ответы на трудные вопросы, находить выходы из затруднительных ситуаций. Здесь можно обнаружить свои ресурсы, опоры, смыслы своей жизни. А можно столкнуться с чувством безысходности, когда кажется, что изменить уже ничего нельзя.\n\nГотовых ответов не будет. Но будет возможность увидеть свою проблему более ясно, найти новые пути решения. Единственно реальным будет решение, которое Вы найдёте для себя сами. Путь к нему может быть нелёгким, но я пройду его вместе с Вами.\n\nПриходите!','',0,'https://teleg.link/Olga0320',0);
