INSERT INTO `avtozakaz_pzmarket` VALUES (583466272,'1425','#продам','Авторская графика','https://www.instagram.com/olgaartschneller','₽ / PZM','#Весь_мир #Россия #Москва','@olgaartschneller',0,'#хобби_и_отдых','фото','AgACAgIAAxkBAALy817sxOKi5PURQRP45yN2wUalOVjYAAIDrjEb4MFpS7ekuE8t3a2WDrC9ki4AAwEAAwIAA3kAA7FsAwABGgQ','https://t.me/podrobno_s_PZP/1425','одобрен','Профессиональный художник.\nЛюблю Жизнь. Все что дышит, растет, издает звуки, меняется, двигается. Все придает мне сил и энергии жить и менять пространство вокруг себя. Красота внутри нас. Поняла недавно что у меня есть этот дар находить в обычных вещах и бытовой рутине искусство и красоту. Делюсь этим с Вами. Предлагаю качественные принты своих графических работ, которые станут украшением вашего интерьера. Формат А4 А3 А2. Стоимость А4 1000руб. А3 1250руб. А2 1500руб. Также принимаю заказы на живопись и графику.\nhttps://www.instagram.com/olgaartschneller\nliokab.dotart.info\nhttps://www.facebook.com/OlgaArtSchneller/','https://i.ibb.co/7RbCZsj/file-262.jpg',1,'https://t.me/check_user_infobot?start=583466272',1592576412);
