INSERT INTO `avtozakaz_pzmarket` VALUES (7,'1430','#продаю','Телеграм Боты','https://t.me/podrobno_s_PZP/1430','Рубль / PZM',' #Россия #ВесьМир','Огнеяр',1,'#услуги','фото','AgACAgIAAx0CReI9xgABCjvUXu-YKnOfN1NEoTby9tuokYuWNvAAAjKvMRunMoFLQIZd-I5W2S4wLYKSLgADAQADAgADeQAD7d0CAAEaBA','https://t.me/podrobno_s_PZP/1430','одобрен','Здравствуте все, я могу создать для Вас и Вашего чата (канала) бота.\n\nПример реализованного бота - https://teleg.link/prizm_market_bot\n\nБот сделан для канала PRIZMarket, он хранит в БД информацию об опубликованых лотах. Так же может показывать курс PRIZM на CoinMarketCap.com, для отдельных чатов есть возможность указывать курс чата в % от КМК.\n\nТак же есть возможность сделать бота админа чата, для удаления в БАН спамеров или любителей кидать посторонние ссылки в чат. \n\nВобщем-то ограничения по ботам только самим API Telegram Bots.\n\nЦена договорная, зависит от сложности поставленной задачи. ','http://f0430377.xsph.ru/image/5eef97c25be5f.jpg',0,'https://teleg.link/Ogneyar_ya',1604083387);
INSERT INTO `avtozakaz_pzmarket` VALUES (699493975,'1431','#продам','Создание Телеграм-Бота','https://t.me/podrobno_s_PZP/1431','₽ / PZM',' #весь_мир','@MrCabbage1',0,'#услуги','фото','AgACAgIAAxkBAAL0aF7yVh_Uyd08oOy96cHPirDNo-SlAAIHsTEbEHyRS-oxdH2SUPI-Zu7pki4AAwEAAwIAA3kAA3b5AgABGgQ','https://t.me/podrobno_s_PZP/1431','одобрен','Создам Телеграм-Бот. Быстро, качественно, дешево. Принимаю PZM, RUB. Писать - @MrCabbage1. Боты — это модно. Боты — специальные аккаунты в Telegram, созданные для того, чтобы автоматически обрабатывать и отправлять сообщения. Пользователи могут взаимодействовать с ботами при помощи сообщений, отправляемых через обычные или групповые чаты.','https://i.ibb.co/WnRB6D6/file-267.jpg',0,'https://t.me/check_user_infobot?start=699493975',1592940447);
