INSERT INTO `avtozakaz_pzmarket` VALUES (978969702,'1452','#продам','Биржа рекламы телеграм','https://t.me/joinchat/AAAAAEm_QabmoBNS_UBrcA','₽ / PZM',' #весь_мир','@Vlagelec',0,'#для_бизнеса','фото','AgACAgIAAxkBAAL8xV8mUWYCTUBnx7kEBsxOCdu44bcdAAIMsDEb668wSfzc2-ITAb8SvcvDki4AAwEAAwIAA3gAAyYwBQABGgQ','https://t.me/podrobno_s_PZP/1452','одобрен','ПРОДАЖА - ПОКУПКА\nРЕКЛАМЫ ИЛИ КАНАЛА TG\nПродать рекламу в телеграм\nКупить рекламу в телеграм\n\n⚠️ УСЛУГА ГАРАНТ 🛡️ 5% ОТ СДЕЛКИ!\n\nНаш бот 👉 @Chetkiy_Treyder_bot\nМенеджер 1. 👉 @Vlagelec','https://i.ibb.co/njZLN7s/file-290.jpg',0,'https://t.me/check_user_infobot?start=978969702',1599490937);
INSERT INTO `avtozakaz_pzmarket` VALUES (1075618494,'1457','#продам','⚗Водный Элексир💧','https://ecomirh2o.ru/ref/1739581','€ / PZM',' #Москва #Семеновская','@DjambalGreen',0,'#красота_и_здоровье','фото','AgACAgIAAxkBAAL-Ul8zweHD2SZJtMpmoscH05C-NVRhAAKPrzEb5XGZSV9OFnl5NfOcIMzDki4AAwEAAwIAA3gAA3ehBQABGgQ','https://t.me/podrobno_s_PZP/1457','одобрен','Вода «Живопись Творца» - это не просто вода.\n\nЭто Продукт Международной программы «Вода для качества жизни», имеющий, благодаря инновационным технологиям, идеальную структуру водного кластера.\n\nЭто – эликсир для внутренней среды человека. Восстанавливает организм человека на клеточном уровне. В ней заложена уникальная формула «интеллектуального» продукта программы, результат действия которой можно почувствовать при ежедневном применении.\n\nЭто - новый био-активный препарат в виде структурированной питьевой природной воды (СПВ) с заданными свойствами, благотворно влияющими на организм человека.\n\nЭто - минеральная, горная, природная вода высшего качества, прошедшая обработку по специальной авторской технологии, усиливающей естественные целебные свойства воды и восстанавливающей природную структуру после производственного процесса бутилирования.\n\nЭто - биологически активная основа для здоровья человека, укрепляет иммунитет, улучшает функции клеток организма, способствует лучшему усвоению лекарственных препаратов и биологически активных добавок.\n\nЭто - уникальный минеральный состав, который прекрасно подходит как для взрослых, так и для детей. Имеет идентичный рН =7.5 равный внутриклеточной жидкости организма человека.','https://i.ibb.co/NgRkTCr/file-295.jpg',1,'https://t.me/check_user_infobot?start=1075618494',1597228209);
