INSERT INTO `avtozakaz_pzmarket` VALUES (780739900,'1454','#продам','Отдых в Сочи','https://t.me/podrobno_s_PZP/1454','₽ / PZM',' #Сочи','@swir1975',0,'#хобби_и_отдых','фото','AgACAgIAAxkBAAL9f18s9oAnXESG7T-iEtcJbm5pa-s2AAI9rzEbCKxoSd0-solob74ifUJ9kS4AAwEAAwIAA3kAA3KqBgABGgQ','https://t.me/podrobno_s_PZP/1454','одобрен','Приглашаем на отдых в наш отель. Есть баня, открытая площадка с мангалом, бассейн и тд. и т.п. Номера все благоустроенные. От 300 руб. место. Принимаем любую крипту.','https://i.ibb.co/sHCnpqB/file-292.jpg',0,'https://t.me/check_user_infobot?start=780739900',1596782354);
