INSERT INTO `avtozakaz_pzmarket` VALUES (464844104,'1455','#продам','Веломобили фирмы Berg','https://t.me/podrobno_s_PZP/1455','₽ / PZM',' #весь_мир #Якутия #Нерюнгри','@InterPROFIT',0,'#личные_вещи','фото','AgACAgIAAxkBAAL92F8vthy0hdZsrL5T6IrO6_Eey9lhAALBrjEbB16ASViCY4SQj4BYdqRMli4AAwEAAwIAA3kAA5hyAAIaBA','https://t.me/podrobno_s_PZP/1455','одобрен','Иметь собственный модный веломобиль бело-розового цвета и участвовать в веселых заездах во дворе наравне с другими ребятами под силу даже хрупкой девочке, особенно если она счастливая обладательница модели «Buddy White» от Berg.\n\nОсобенности:\n\n- Веломобиль представляет собой транспортное средство, изготовленное по принципу велосипеда.\n\n- Его металлическая конструкция отличается высокой прочностью и надежностью, она сделана таким образом, что данный транспорт может ехать и вперед, и назад, и тормозить с помощью падалей. Всего скоростей 3.\n\n- Особая конструкция подвески и поворотная ось обуславливают плавность передвижения веломобиля и его маневренность.\n\n- Регулируемое в 3 позициях сиденье позволяет настроить его положение так, чтобы водителю было максимально комфортно.\n\n- Руль также имеет возможность регулировки.\n\n- Надувные колеса веломобиля диаметром 31,5 см изготовлены из резины, они отлично сглаживают различные неровности дороги. Их мощный рисунок протектора позволяет ездить даже по легкому бездорожью. Кроме того, их конструкция предполагает наличие подшипников.\n\n- Управление этим транспортным средством осуществляется с помощью руля и педалей.\n\n- Возможна установка дополнительных аксессуаров, которые приобретаются отдельно.\n\n- Веломобили от Berg отличаются высоким уровнем качества, безопасности, а также прочности.\n\n- Модель «Buddy White» изготовлена из качественных материалов, отличающихся долговечностью и повышенной износостойкостью.\n\nХарактеристики:\n\nВозраст: от 3 до 8 лет.\n\nКомплектация: 1 веломобиль.\n\nЦвет: бело-розовый.\n\nМаксимальная нагрузка: 45 кг.\n\nРазмер шин: 31,5 см.\n\nРегулировка сиденья: 3 положения.\n\nРасстояние от педалей до сиденья: 38-55 см.\n\nДорожный просвет: 7,5 см.\n\nМатериал: металл, пластик, резина.\n\nРазмер: 110 х 65 х 63 см.\n\nВес: 18 кг.\n\nБренд: Berg.\n\nСтрана обладатель бренда: Нидерланды.','https://i.ibb.co/54H3Mgg/file-293.jpg',0,'https://t.me/check_user_infobot?start=464844104',1596962663);
INSERT INTO `avtozakaz_pzmarket` VALUES (464844104,'1456','#продам','Аппарат сахарной ваты: Floss Boss','https://t.me/podrobno_s_PZP/1456','₽ / PZM',' #Весь_мир #Якутия #Нерюнгри','@InterPROFIT',0,'#для_бизнеса','фото','AgACAgIAAxkBAAL-E18xLW3UHTZKOqtTZVPmUjmgX8rjAALNrjEbmymJSTvjnikNka8Q3xaili4AAwEAAwIAA3gAA1oLAAIaBA','https://t.me/podrobno_s_PZP/1456','одобрен','Аппарат с алюминиевым ловителем для приготовления сахарной ваты, нагрев спираль, имеет производительность от 3.6 до 4.5 кг/ч. Цвет корпуса аппарата - розовый. Сетка для ловителя и защитный пластиковый купол  входят в комплект. Производитель: Gold Medal Products, СОЕДИНЕННЫЕ ШТАТЫ','https://i.ibb.co/XsWBPBK/file-294.jpg',0,'https://t.me/check_user_infobot?start=464844104',1597058701);
INSERT INTO `avtozakaz_pzmarket` VALUES (7,'','#продаю','квартира','https://www.youtube.com/watch?v=jYeNkxgLAag','рубль / PZM',' #сочи','Огонь',0,'#недвижимость','фото','','','','ПО \"ВМЕСТЕ\" г. Сочи продаем квартиру рядом с центром.\n110квм- жилая площадь 3 комнаты\nВ доме 15 квартир. Двор тихий, закрытая территория. Шлагбаум, ворота, охранник.\nБольшая квартира с раздельными комнатами. Окна выходят на разные стороны (большой плюс для тех кто любит свежий воздух. Быстро проветривается и легкая прохлада без использования кондиционера). Газовый котел(маленькие коммунальные). Продаю вместе с мебелью.\nДо моря пешком 35 минут, на авто 10 минут. До ж/д 20 минут пешком. Рядом магнит, екатерининская клиника.\n\n✅Дорогая гранитная барная стойка. \n✅Новая кухня со всей новой техникой(посудомоечная машина+духовая плита+газовая \n✅Плита+вытяжка+микроволновка).\n✅Шикарная ванная-джакузи!\nстоимость 13 500 000руб \nВозможен обмен на дом или другую квартиру с моей или вашей доплатой, авто, земельный участок, цифровые активы, призм.','',0,'https://teleg.link/ogonsvet',0);
