INSERT INTO `avtozakaz_pzmarket` VALUES (7,'1465','#продаю','Капорский чай','https://vk.com/lesrad59','Рубль / PZM','#ВесьМир','AlexForest',0,'#продукты_питания','фото','AgACAgIAAx0CReI9xgABECohX1DBIemk9yleygYHB6FrUXgUZzMAAnKuMRuoxohKPb57dFE_UGd0fNeWLgADAQADAgADeAADuuEAAhsE','https://t.me/podrobno_s_PZP/1465','одобрен','Мы - семья Лесных. С 2012 года мы занимаемся изготовлением ферментированного иван-чая.\nЧат создан для сбора заявок на приобретение иван-чая, формирования совместных закупок (вы можете найти людей из вашего города и объединиться с ними).\n🌍 Собираем иван чай в экологически чистом Оханском районе Пермского края.\nУ нас вы можете приобрести крупнолистовой иван-чай двойной ферментации.\n🌿 Чай изготовлен ручным способом, без соприкосновения с металлом, без наёмных работников! Максимальный оптовый заказ 20 кг.\n🚚 Варианты доставки:\nПочта России (отправка из г. Оханск или г. Краснокамск);\nтраспортные компании СДЭК и Деловые линии (отправка из г. Краснокамск).\nСамовывоз из Краснокамска, Глазова (Удмуртская република),\nДля жителей Перми, Краснокамска, Нытвы, Оханского района, Очерского района и города Глазова (Удмуртия) возможны индивидуальные варианты с доставкой на дом (встреча в городе).\n☀️Отправка посылки тоже за призм☀️\nОтправка заказов один раз в 2 недели, посылки Почтой России до 3 кг отправляем в течении трех рабочих дней из Оханска.\n✅ Цена:\nза 100 гр 300 руб;\nот 2 кг до 5 кг 250 руб;\nот 5 кг 200 руб;\nпо вопросам более крупных партий пишите в лс.\n☀️Стоимость в призм, конвертируем в день отправки товара☀️\n🗣Пишем заявку здесь, после связываемся в личке 🗣\nВозможен бартер на мёд, пергу, современный настольный ткацкий станок. Если у вас есть другие варианты пишите в лс.','http://f0430377.xsph.ru/image/5f50ad25b4c55.jpg',0,'https://teleg.link/lessad108',1599122726);
INSERT INTO `avtozakaz_pzmarket` VALUES (169115052,'1466','#продам','Косметический Девайс DeVita Cosmo','https://devita-world.ru/products/devitacosmo','₽ / PZM',' #весь_мир #россия #екатеринбург','@eugeneselyanin',0,'#красота_и_здоровье','фото','AgACAgIAAxkBAAEBAYZfUMdJQwQfnjuZ5_kpH059Qvk9nAACt60xG9v2iUoXBJkE7OCnbOrV9pQuAAMBAAMCAAN4AAOZKwQAARsE','https://t.me/podrobno_s_PZP/1466','одобрен','👨‍⚕️DeVita Cosmo с уникальной квантовой насадкой решает косметологические проблемы и оздоравливает организм при помощи биорезонансных технологий.\n\n🧏В отличие от косметических средств, Cosmo воздействует на глубокие слои кожи и совершенствует ее изнутри. А оздоравливающие программы устройства можно использовать для всей семьи.\n\n🔗Сочетает воздействие биорезонанса и квантовых технологий;\n💃Борется с признаками старения, подтягивает кожу;\n💆Устраняет воспаление, помогает при угревой сыпи и куперозе;\n💅Благотворно воздействует на кожу, волосы и ногти.\n✈️Инфоканал Телеграм @devitaworld\n📸Инстаграм https://instagram.com/infoportal_devitaworld?igshid=1phrat2fp4wki','https://i.ibb.co/vHh3R2P/file-301.jpg',0,'https://t.me/check_user_infobot?start=169115052',1600598590);
