INSERT INTO `avtozakaz_pzmarket` VALUES (1075618494,'1471','#продам','Нейро Система Космос','https://youtu.be/3Qwli_SVmwM','₽ / PZM',' #Весь_мир #Россия #Москва','@DjambalGreen',0,'#бытовая_электроника','фото','AgACAgIAAxkBAAEBAn1fWjbPi0b56EjDrAxasVf6qmT80gAC5q8xG_oI0EpsPg_e_6RL3zmL5pEuAAMBAAMCAAN4AAPVxgYAARsE','https://t.me/podrobno_s_PZP/1471','одобрен','Наша миссия – внедрить и развивать экологичную систему управления жизнью. Одним из первых шагов, наиболее простых в освоении, является управление своим здоровьем. \n\nЗдоровье – единственный ресурс в любом вашем начинании, управление которым зависит только от вас. \n\nНаша цель – дать вам инструменты нейро-когнитивного управления здоровьем, объединённые в единую Систему “Космос”.                                                                                                                                                             Система нейро-когнитивного управления здоровьем «Космос» – это инновационный продукт для управления здоровьем и качеством жизни.\n\nОн позволяет человеку использовать резервы и возможности своего организма для решения различных проблем со здоровьем, а так же программирования желаемых сценариев в жизни.  нейро-когнитивное программирование цепочек событий и создание сложных многокомпонентных сценариев жизни, в которых основным сценаристом, режиссёром и актёром являетесь Вы.\n\nПереход на этот уровень развития личности раскрывает новые горизонты возможностей. Воспользоваться этим уровнем ответственности возможно лишь находясь в высокоресурсном состоянии.\n\nДля того, чтобы приблизиться к требуемому состоянию ресурсности, Вам необходимо в совершенстве овладеть инструментами Системы нейро-когнитивного управления здоровьем “Космос”.\n\nСтаньте автором истории новой своей жизни!','https://i.ibb.co/WgrKwkv/file-303.jpg',1,'https://t.me/check_user_infobot?start=1075618494',1603055837);
INSERT INTO `avtozakaz_pzmarket` VALUES (401916849,'1473','#продам','Коттедж 600 м² на участке 7 сот.','https://t.me/podrobno_s_PZP/1473','₽ / PZM',' #геленджик #дивноморское','@ogonsvet',0,'#недвижимость','фото','AgACAgIAAxkBAAEBArFfWrIxmq0L-ntxQNgpsIk4j2S6LwACm7AxG9h_2Uph9x8xgPQvJYMBRZYuAAMBAAMCAAN4AAOYzgEAARsE','https://t.me/podrobno_s_PZP/1473','одобрен','Продам коттедж в Дивноморске, ст «Парус».\n Обзорный вид на море в 180 градусов с одной стороны и горы с другой.\nДо песчаного пляжа приблизительно 2 км.\nЧерновая отделка. Материал стен - кирпич. \n На этаже местами вставлены двери, стеклопакеты. \nСвет по границе участка. Бетонный накопитель воды.\nВозможно использовать для себя и под гостиницу (удобная планировка этажами). \nМесто очень красивое. Документы готовы.\nВозможен обмен на авто с Вашей доплатой.\nСтоимость 12 млн руб.\n При оплате монетами призм ОЧЕНЬ ХОРОШАЯ СКИДКА','https://i.ibb.co/jhGcfRR/file-304.jpg',1,'https://t.me/check_user_infobot?start=401916849',1601147968);
INSERT INTO `avtozakaz_pzmarket` VALUES (812969463,'1472','#продам','Мазь для суставов','https://t.me/podrobno_s_PZP/1472','₽ / PZM',' #весьмир #Россия #нижнийновгород','@OlgaMartynovaNN',0,'#красота_и_здоровье','фото','AgACAgIAAxkBAAEBAuFfWwFl_qKy08nXXjgyn5YQlmD-eAAClK4xG6Vd2UrZ4qLAeo6rwolk0ZYuAAMBAAMCAAN4AAOHeAACGwQ','https://t.me/podrobno_s_PZP/1472','одобрен','✅ Spine salve-позвоночная мазь\n\n🍃🍃🍃🍃🍃🍃🍃🍃🍃🍃🍃\n\n🤓Состав: Корень окопника, растительные масла, пчелиный воск.\n\n‼Эффективное средство местного применения при мышечных и суставных болях и воспалениях.\n❤Действие препарата приводит к ускорению процессов заживления ран и язвенных поражений, стимулирует процессы регенерации эпителия и рост костной ткани, уменьшает болевые ощущения.\n\n 🤓Окопник, его ещё называют живокостом, входящий в состав мази, является лечебным растением для лечения суставов и зарастания переломов. \n❤Препарат обладает противовоспалительным и кровоостанавливающим действием.\n ❤Мазь очень часто применяют при повседневных ушибах и спортивных травмах.\n \n👉Применяется при:\nМежпозвоночных грыжах, протрузиях межпозвонковых дисков, \nрадикулите и остехондрозе, переломах костей, \nушибах и растяжениях, ревматических и подагрических болях.\n\nМы ВКонтакте👉 http://vk.com/vertexmaxnn','https://i.ibb.co/DkwY5Gr/file-305.jpg',0,'https://t.me/check_user_infobot?start=812969463',1599800262);
