INSERT INTO `avtozakaz_pzmarket` VALUES (130656511,'1489','#продам','Медицинские 😷 маски','https://t.me/podrobno_s_PZP/1489','₽ / PZM',' #Россия','@nikola1711',0,'#красота_и_здоровье','фото','AgACAgIAAxkBAAEBB-dfhSG1lpmWW2qH3bqU2RbmYF_JIwACea4xG1q0KUj-YyDnsjEStBJ-15YuAAMBAAMCAAN4AANtVQIAARsE','https://t.me/podrobno_s_PZP/1489','одобрен','Маска применяется в качестве барьерного средства между персоналом и пациентом, в том числе при возникновении угрозы распространения инфекций, передающихся воздушно-капельным путем.\nМаска предназначена для широкого применения.\nМаска представляет собой изделие прямоугольной формы, без сквозных отверстий, с тремя заложенными складками. С боковых сторон маски находиться две фиксирующие заушные резинки. На верхней стороне лицевой части маски по длине установлен носовой фиксатор.\nКонфигурация: 3 слоя, СС-СМС-СМС\nЦвет: голубой (артикул 4000), белый (артикул 4001)\nНосовой фиксатор: стальная проволока в полипропиленовой оболочке\nСпособ крепления: на эластичных резинках\nРазмер маски: 175х95 мм\nТип маски I\nГОСТ Р 58396-2019\nНЕСТЕРИЛЬНО\nРЕГИСТРАЦИОННОЕ УДОСТОВЕРЕНИЕ №РЗН 2020/9944 ОТ 02.04.2020\nСЕРТИФИКАТ СООТВЕТСТВИЯ № РОСС RU.АБ69.Н00014 от 20.08.2020\nУпаковка: 100 шт. в ПЭ-упаковке (герметичная запайка), 10 упаковок в коробке. 1000 масок в коробе.','https://i.ibb.co/6rnF4LF/file-314.jpg',0,'https://t.me/check_user_infobot?start=130656511',1602560597);
