INSERT INTO `avtozakaz_pzmarket` VALUES (1077787972,'1495','#продам','Чаи высокосортные','https://t.me/podrobno_s_PZP/1495','₽ / PZM',' #Уфа #Россия','@Aleksnevskii',0,'#продукты_питания','фото','AgACAgIAAxkBAAEBCTJfi04QMkUpzgMGT9zZsiz6omj_XwACxrAxG3m4YEh3F1rARjt5kvgVcJcuAAMBAAMCAAN5AAMa-wEAARsE','https://t.me/podrobno_s_PZP/1495','одобрен','Чаи высокосортные, с лучших плантаций, Китая, Индии, Цейлона. Вьетнама. \nДоставка от 300 гр Самовывоз! \nТеГуаньИнь -300 руб 100гр\nУлун  лимон-200руб 100 гр\nУлун-200руб 100гр\nМолочный Улун-240руб 100гр\nЦейлонский черный -190руб 100гр\nИндия Ассам черный  -160руб 100гр\nОплата принимается в PZM\nС какого чая начать утро, чтобы день был удачным? Китайцы ответят: «Разумеется, с Те Гуань Инь!». Как и полагается, у особенного улуна не только шикарный вкус, но и уникальные свойства.\nЧай для здоровья и красоты. \nГарантКачества !','https://i.ibb.co/dGtrfF5/file-320.jpg',1,'https://t.me/check_user_infobot?start=1077787972',1603943750);
INSERT INTO `avtozakaz_pzmarket` VALUES (1075618494,'1496','#продам','КРИПТОТАКСИ','https://youtu.be/vORS_yJcmek','€ / PZM',' #Весь_мир','@DjambalGreen',0,'#транспорт','фото','AgACAgIAAxkBAAEBCWdfi2cuHW7eH5oP5y24pPHbEJ9pSwACnrAxG1F3WEhQo5CwBhSSOU4cypcuAAMBAAMCAAN4AANmugEAARsE','https://t.me/podrobno_s_PZP/1496','одобрен','Получите доступную и комфортную поездку с Dylyver в вашем городе.\nDylyver - это приложение для обмена поездками, которое позволяет быстро запросить поездку и добраться до пункта назначения одним нажатием кнопки. Просто закажите автомобиль, заберите его у ближайшего водителя и наслаждайтесь поездкой до места назначения без стресса.          Заказать поездку с приложением Dylyver легко:\n1. Просто откройте приложение и введите пункт назначения\n2. Нажмите кнопку запроса\n3. Проверьте данные вашего водителя и отслеживать его прибытие в режиме реального времени\n4. Наслаждайтесь комфортной поездкой\n5. Доберитесь до пункта назначения и внесите оплату в приложении кредитной картой или наличными\n\nОсобенности приложения Dylyver:\n\n• Отслеживайте положение вашего водителя в режиме реального времени, когда он приближается к вашему месту посадки\n• Разделите плату за поездку с друзьями\n• Закажите поездку или доставку с водителями, которых вы знаете и которым доверяете\n• Приглашайте пользователей и водителей и зарабатывайте реферальные платежи за каждую поездку, которую они совершают.\n• Оплачивайте свои поездки с помощью кредитной карты или наличными\n• Легко найти водителя в месте получения, используя встроенную функцию дополненной реальности\n\nЗагрузите приложение Dylyver и совершите свою первую поездку сегодня.  https://dylyver.app.link/ZnwiemPscab\n\nХотите заработать дополнительные деньги на своем автомобиле? Загрузите приложение для водителя Dylyver и зарегистрируйтесь в качестве водителя.  https://dylyverdriver.app.link/aPyCTnPscab','https://i.ibb.co/fpSVbhw/file-321.jpg',1,'https://t.me/check_user_infobot?start=1075618494',1602972502);
