INSERT INTO `avtozakaz_pzmarket` VALUES (971086199,'1500','#продам','Колыбель','https://t.me/podrobno_s_PZP/1500','₽ / PZM',' #весь_мир #Россия #Челябинск','@ostrom74',0,'#для_дома_и_дачи','фото','AgACAgIAAxkBAAEBCa1fjIPHPfVLek7irpyfv6B5fnCoCgACc7ExG4uhYUj306hv_3HBV9j_w5cuAAMBAAMCAAN5AAOWxQEAARsE','https://t.me/podrobno_s_PZP/1500','одобрен','Колыбель – прекрасное место для пребывания новорождённого. Эстетика выполнения этого приспособления усиливает любовь к Вашему ребёнку, прибывшему в наш Мир. Материал – Сосна. После обработки маслом (на фото не обработанная) приобретает весёлый ярко желтый цвет, как наше весеннее Солнышко. Размеры: 800х750х500 мм. Разборная. Стоимость 10.000 руб.','https://i.ibb.co/mJ5nF79/file-322.jpg',1,'https://t.me/check_user_infobot?start=971086199',1603044351);
INSERT INTO `avtozakaz_pzmarket` VALUES (971086199,'1501','#продам','Календарь Майя','https://t.me/podrobno_s_PZP/1501','₽ / PZM',' #Весь_мир #Россия #Челябинск','@ostrom74',0,'#для_дома_и_дачи','фото','AgACAgIAAxkBAAEBCjRfjdqnIt0VP8t5GrFBv1KLGIEDpgACkrAxG1nPcEjDT9Bci9dOD0duU5guAAMBAAMCAAN5AAPb6QEAARsE','https://t.me/podrobno_s_PZP/1501','одобрен','Календарь Майя –Прекрасный эстетический подарок. Владение календарём говорит о возможности вашего сознания оперировать информацией с разных эпох развития человечества, широким сознанием и нетривиальным взглядом на наш Мир. Материал –Ясень, Диаметр 600 мм, толщина 50 мм. Обработка –масло. Стоимость 12.000 руб. Подробнее: vesta74@bk.ru, 8(919)33-777-19.','https://i.ibb.co/L8hyxrk/file-323.jpg',0,'https://t.me/check_user_infobot?start=971086199',1603132511);
INSERT INTO `avtozakaz_pzmarket` VALUES (971086199,'1502','#продам','Зеркала в рамах из Ясеня','https://t.me/podrobno_s_PZP/1502','₽ / PZM',' #Весь_мир #Россия #Челябинск','@ostrom74',0,'#для_дома_и_дачи','фото','AgACAgIAAxkBAAEBCnlfjyGzqCF9xfUeUvjh1SvCKdDnxQACKLAxG3ymeEh_D3GGCCd-Luqd6JcuAAMBAAMCAAN5AAMtCQIAARsE','https://t.me/podrobno_s_PZP/1502','одобрен','Зеркало в раме из благородного Ясеня – показывает не только Ваше отражение, но и Ваш внутренний мир. Ясень – «Ведьмино дерево», поэтому возникает стойкое чувство, что зеркало в раме из Ясеня показывает Вам чуть больше обычного. Зеркала в современных пластиковых окладах (рамах) – бездушный отражатель, а в рамах из Ясеня – большое окно  в мир. Вы это почувствуете сами.  Более 150 разных форм рам, размеры масштабируются.  Материал – Ясень на подложке из шлифованной фанеры. Размеры данного образца 1200х850х50. Стоимость с зеркалом 12.000 руб в этом размере. Подробней: vesta74@bk.ru, +7(919)33-777-19.','https://i.ibb.co/423gLDx/file-324.jpg',1,'https://t.me/check_user_infobot?start=971086199',1603215852);
INSERT INTO `avtozakaz_pzmarket` VALUES (302772799,'1503','#продам','Коллаген','https://t.me/podrobno_s_PZP/1503','₽ / PZM',' #весь_мир','@NatalyaMenkova',0,'#красота_и_здоровье','фото','AgACAgIAAxkBAAEBCplfj24DVFVJOhU4TaWLLfR-q3ZE4QACD7AxG9eNgUgoR5BC-liip9cHn5YuAAMBAAMCAAN5AAPc4AIAARsE','https://t.me/podrobno_s_PZP/1503','одобрен','❤️Высокомолекулярный нативный коллаген Vertera HC уже попробовали?\n⠀\nЭФФЕКТИВНО ОМОЛАЖИВАЕТ КОЖУ БЕЗ УКОЛОВ И ПЛАСТИЧЕСКИХ ОПЕРАЦИЙ.\n⠀\n✅Для кожи лица и декольте:\n⠀\n✔️Оказывает лифтинг-эффект\n⠀\n✔️Подтягивает контур лица\n⠀\n✔️Способствует выработке эластина, стимулирует регенерацию\n⠀\n✔️Устраняет шрамы, рубцы, растяжки\n⠀\n✅Для кожи рук и тела:\n⠀\n✔️Устраняет целлюлит, растяжки, рубцы, повышает упругость и эластичность\n⠀\n✔️Обновляет и омолаживает кожу\n⠀\n✅Для красоты волос:\n⠀\n✔️Запечатывает секущиеся кончики\n⠀\n✔️Восстанавливает волосы после окрашиваний и осветлений\n⠀\n✔️Питает фолликулы\n⠀\n✔️Лечит дефекты волос, а не маскирует их!\n⠀\n🔥Эффект после первого ПРИМЕНЕНИЯ!🔥\n\nЦена 100 ml - 3500 руб.','https://i.ibb.co/pzkRh5M/file-325.jpg',0,'https://t.me/check_user_infobot?start=302772799',1603235479);
INSERT INTO `avtozakaz_pzmarket` VALUES (820063085,'1504','#продам','ПРЕДЛАГАЕМ супер тушенку!','https://t.me/joinchat/MOErbRaSs2iuSDUTaxe75g','₽ / PZM',' #Россия','@partizansm',0,'#продукты_питания','фото','AgACAgIAAxkBAAEBCrxfj-OOhMdmoZLq4fweulnZb5734gACTa4xGxDUgUiqEwABaq9WkmKu1_aULgADAQADAgADeQADaP4FAAEbBA','https://t.me/podrobno_s_PZP/1504','одобрен','ПРЕДЛАГАЕМ супер тушенку!\nТушёная: свинина, говядина, лось, перепёлка. \nПроизводство г.Смоленск.\nВес: 365 гр.\nСрок годности: 3 года.\n🎯 По наличию уточняйте в группе, т.к. свинина всегда есть, остальные категории по мере изготовления.\n🎲 Стоимость в призм или других криптовалютах рассчитываем в день отправки товара.\n👉 Пишем заявку в группе, после связываемся в личке.\n🚚 Бесплатно отправка от упаковки по России. Упаковка 45 банок. Если берёте упаковку,то можно заказать 15 банок говядины, 15 банок свинины, 15 банок лось или другие вариации.\nМинимальный заказ 10 банок. \n💰 Цены в рублях на 21.10.2020:\n🐖 Свинина 180\n🐂 Говядина 220\n🦌 Лось 220\n🦆Перепёлка 250','https://i.ibb.co/mbD5dDk/file-326.jpg',0,'https://t.me/check_user_infobot?start=820063085',1603524603);
INSERT INTO `avtozakaz_pzmarket` VALUES (971086199,'1505','#продам','Знаки Зодиака из Ясеня.','https://t.me/podrobno_s_PZP/1505','₽ / PZM',' #Весь_мир #Россия #Челябинск','@ostrom74',0,'#для_дома_и_дачи','фото','AgACAgIAAxkBAAEBCuRfkHt2blUQC4axf1TeYWC5DCQbLAACkbExG3ymgEhhFnppFn54DdjoUZguAAMBAAMCAAN5AAOt_gEAARsE','https://t.me/podrobno_s_PZP/1505','одобрен','Знаки Зодиака. Материал- Ясень, Обработка -Масло. Диаметр 380 мм, Толщина 25-35 мм. Стоимость 3.500=00 руб\nИзделия «Знаки Зодиака»  являются генераторами личной жизненной энергии 1 уровня (широкополосные). Благотворно влияют на людей, родившихся в этот астрологический период. Положительное влияние происходит через связку даты рождения и общепринятого образа в астрологии. На людей, родившихся в другие периоды, влияние только эстетическое, как предмет искусства. Изделие НЕ САКРАЛЬНОЕ, и потому, может служить прекрасным подарком. Более подробно : vesta74@bk.ru, +7(919)33-777-19.','https://i.ibb.co/8g3DN1k/file-327.jpg',1,'https://t.me/check_user_infobot?start=971086199',1603304429);
