INSERT INTO `avtozakaz_pzmarket` VALUES (302772799,'1506','#продам','Косметика для SPA процедур','https://t.me/podrobno_s_PZP/1506','₽ / PZM',' #весь_мир','@NatalyaMenkova',0,'#красота_и_здоровье','фото','AgACAgIAAxkBAAEBCyRfkVqzMe-ICJllq-iPR19zWkTqcAACIbAxG2bqkUi4GXINCs2ylhCR5ZcuAAMBAAMCAAN5AAPlHgIAARsE','https://t.me/podrobno_s_PZP/1506','одобрен','Линейка косметики  Thalasso Cosmetics, которая способна обеспечить полноценный уход за кожей на уровне спа-салона класса «люкс».\n⠀\nВ нее входят масла, пилинги, скрабы, экстракты, гели и сыворотки. Основа Thalasso Cosmetics - ламинария, а если быть точнее, содержимое клетки ламинарии.\n⠀\nЭффекты качественной талассокосметики основываются на высоком содержании в водорослях следующих компонентов:\n⠀\n✔️Альгиновая кислота и её соли (альгинаты). Связывают и выводят из организма шлаки и токсины, отлично увлажняют и заживляют микроповреждения кожи;\n\n✔️Аминокислоты. Участвуют во всех клеточных процессах, помогают усваивать витамины и минералы, естественным образом увлажняют кожу;\n\n✔️Белки и липиды (растительные жиры) — «строительный материал» для клеток кожи;\n\n✔️Кальций, магний, калий, марганец, натрий, фосфор, сера – вещества, помогающие организму усваивать белки и липиды;\n\n✔️Йод, цинк, никель, медь, железо, стронций, бор, бром — необходимы для синтеза жизненно важных гормонов, влияющих на внешний вид и здоровье;\n\n✔️Витамины А, С, D, E, F, K, PP и все витамины группы В\n\nКосметику можно приобретать как в наборе, так и по отдельности. \n⠀','https://i.ibb.co/THF41VQ/file-328.jpg',0,'https://t.me/check_user_infobot?start=302772799',1603362258);
INSERT INTO `avtozakaz_pzmarket` VALUES (520896160,'1507','#продам','Эко сумки 100 хб','https://t.me/podrobno_s_PZP/1507','₽ / PZM',' #весь_мир','@dmitri108',0,'#личные_вещи','фото','AgACAgUAAxkBAAEBC3FflAFo0IvagJ1OjNU6Kch3xXHnuAACz6oxG9knoFRw53BhYnO-GogSSmx0AAMBAAMCAAN5AAPo6gMAARsE','https://t.me/podrobno_s_PZP/1507','одобрен','Стоимость 300 Prizm + стоимость посылки.\nВозможна скидка при оптовых заказах.\n\nМодные эко-сумки ручной работы (эко сумки, промо сумки), сумка для покупок, ручки длинные, через плечо. Примерный размер 38х39 см.\n\nПростой крой, отличный сувенир и подарок для делегатов съездов (экологов и женских обществ). Подарки и презенты на выставках и ярмарках, хорошее дополнение к фирменным товарам и подаркам (салоны подарков).\n\nСтильная и экологичная альтернатива одноразовым пакетам.\nУдобные эко-сумки сделаны из натурального 100% плотного хлопка, легко сворачиваются до компактных размеров - можно всегда носить с собой на случай спонтанных покупок.\n\nМожно использовать как заготовку для росписи акрилом, вышивки или печати принта, фирменного логотипа и др.','https://i.ibb.co/6Bnw7wm/file-329.jpg',0,'https://t.me/check_user_infobot?start=520896160',1603535698);
